    private boolean isMagicSquare(int[][] grid, int row, int col) {
        Set<Integer> numbers = new HashSet<>();
        for (int i = 0; i < 3; i++) {
            for (int j = 0; j < 3; j++) {
                if (grid[row + i][col + j] <= 9 && grid[row + i][col + j] >= 1) {
                    numbers.add(grid[row + i][col + j]);
                } else {
                    return false;
                }
            }
