public class Solution {
    public int largestIsland(int[][] grid) {
        int n = grid.length;
        Map<Integer, Integer> parent = new HashMap<>();
        Map<Integer, Integer> size = new HashMap<>();
        int[] directions = {-1, 0, 1, 0, -1};

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 1) {
                    parent.put(i * n + j, i * n + j);
                    size.put(i * n + j, 1);
                }
            }
        }

        int maxArea = 0;

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 0) {
                    boolean[] visited = new boolean[n * n];
                    int area = dfs(grid, parent, size, directions, i, j, visited);
                    maxArea = Math.max(maxArea, area);
                }
            }
        }

        return maxArea;
    }

    private int dfs(int[][] grid, Map<Integer, Integer> parent, Map<Integer, Integer> size, int[] directions, int i, int j, boolean[] visited) {
        if (i < 0 || i >= grid.length || j < 0 || j >= grid[0].length || grid[i][j] != 1 || visited[i * grid[0].length + j]) {
            return 0;
        }

        visited[i * grid[0].length + j] = true;

        int area = size.get(parent.get(i * grid[0].length + j));

        for (int k = 0; k < directions.length - 1; k++) {
            int x = i + directions[k];
            int y = j + directions[k + 1];

            if (x >= 0 && x < grid.length && y >= 0 && y < grid[0].length) {
                area += dfs(grid, parent, size, directions, x, y, visited);
            }
        }

        return area;
    }
}

