public class Solution {
    public int[][] flipAndInvertImage(int[][] image) {
        for (int[] row : image) {
            reverse(row);
            invert(row);
        }
        return image;
    }

    private void reverse(int[] arr) {
        int left = 0, right = arr.length - 1;
        while (left < right) {
            int temp = arr[left];
            arr[left] = arr[right];
            arr[right] = temp;
            left++;
            right--;
        }
    }

    private void invert(int[] arr) {
        for (int i = 0; i < arr.length; i++) {
            arr[i] = arr[i] == 1 ? 0 : 1;
        }
    }
}

