    public int nthMagicalNumber(int n, int a, int b) {
        long lcm = (long)a * b / gcd(a, b);
        long mod = 1000000007;
        long left = 1, right = (long)1e9 + 7;
        while (left < right) {
            long mid = left + (right - left) / 2;
            if ((mid / a + mid / b - mid / lcm) >= n)
                right = mid;
            else
                left = mid + 1;
        }
