public class Solution {
    public int profitableSchemes(int n, int minProfit, int[] group, int[] profit) {
        long[][] dp = new long[1001][minProfit + 1];
        for (int i = 0; i <= n; i++) {
            dp[i][0] = 1;
        }
        for (int i = 0; i < group.length; i++) {
            for (int j = n; j >= group[i]; j--) {
                for (int k = minProfit; k >= profit[i]; k--) {
                    dp[j][k] += dp[j - group[i]][k - profit[i]];
                    if (dp[j][k] >= 1000000007) {
                        dp[j][k] -= 1000000007;
                    }
                }
            }
        }
        long ans = 0;
        for (int i = n; i >= 0; i--) {
            ans += dp[i][minProfit];
            if (ans >= 1000000007) {
                ans -= 1000000007;
            }
        }
        return (int) ans % 1000000007;
    }
}

