public class Solution {
    public String maskPII(String s) {
        StringBuilder email = new StringBuilder();
        for (char c : s.toCharArray()) {
            if (Character.isLetter(c)) {
                email.append(Character.toLowerCase(c));
            } else if (c == '@') {
                email.append('@');
            }
        }

        int indexAt = email.indexOf('@');
        String localPart = email.substring(0, indexAt);
        String domain = email.substring(indexAt + 1);

        StringBuilder maskedEmail = new StringBuilder();
        for (int i = 0; i < localPart.length(); i++) {
            if (i == 0 || i == localPart.length() - 1) {
                maskedEmail.append(localPart.charAt(i));
            } else {
                maskedEmail.append("*");
            }
        }

        return String.format("%s@%s", maskedEmail.toString(), domain.replace(".", "*"));
    }

    public String maskPII_phone(String s) {
        StringBuilder sb = new StringBuilder();
        for (char c : s.toCharArray()) {
            if (Character.isDigit(c)) {
                sb.append(c);
            }
        }

        int countryCodeLength = sb.length() - 10;
        StringBuilder maskedNumber = new StringBuilder();

        switch (countryCodeLength) {
            case 0:
                maskedNumber.append("*****-****");
                break;
            case 1:
                maskedNumber.append("+*-***-****");
                break;
            case 2:
                maskedNumber.append("+--*-***-****");
                break;
            case 3:
                maskedNumber.append("+---***-****");
                break;
        }

        return maskedNumber.toString().replace("*", sb.substring(0, countryCodeLength)).replace("****", sb.substring(countryCodeLength));
    }
}

