public class Solution {
    public double new21Game(int n, int k, int w) {
        if (k == 0 || k > n) return 1.0;

        double[] dp = new double[n + 1];
        dp[0] = 1.0;
        for (int i = 1; i <= Math.min(k - 1, n); i++) {
            dp[i] = 1.0 / w;
        }

        for (int i = k; i <= n; i++) {
            double sum = 0;
            for (int j = Math.max(1, i - w); j < k; j++) {
                sum += dp[j];
            }
            dp[i] = sum;
        }

        return dp[n];
    }
}

