                while (set.contains(temp)) {
                    temp++;
                }
                map.put(c, temp);
                set.add(temp);
            }
        }

        List<String> result = new ArrayList<>();
        for (String word : words) {
            Map<Character, Character> wordMap = new HashMap<>();
            boolean match = true;
            for (int i = 0; i < word.length(); i++) {
