                if (!wordMap.containsKey(c)) {
                    if (!map.containsKey(c)) {
                        match = false;
                        break;
                    }
                    wordMap.put(c, map.get(c));
                } else if (wordMap.get(c) != map.get(c)) {
                    match = false;
                    break;
                }
            }

            if (match) {
                result.add(word);
            }
        }

        return result;
    }
