import java.util.*;

public class Solution {
    public int[] hitBricks(int[][] grid, int[][] hits) {
        int m = grid.length;
        int n = grid[0].length;
        boolean[][] visited = new boolean[m][n];
        List<int[]> bricks = new ArrayList<>();
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 1) {
                    bricks.add(new int[]{i, j});
                }
            }
        }

        int[] result = new int[hits.length];
        for (int i = 0; i < hits.length; i++) {
            int x = hits[i][0];
            int y = hits[i][1];

            if (grid[x][y] == 0) continue;

            grid[x][y] = 0;
            visited[x][y] = true;

            Deque<int[]> queue = new ArrayDeque<>();
            queue.offer(new int[]{x, y});

            while (!queue.isEmpty()) {
                int[] curr = queue.poll();
                int currX = curr[0];
                int currY = curr[1];

                for (int[] dir : dirs) {
                    int newX = currX + dir[0];
                    int newY = currY + dir[1];

                    if (newX < 0 || newX >= m || newY < 0 || newY >= n || grid[newX][newY] == 0 || visited[newX][newY]) continue;

                    visited[newX][newY] = true;
                    queue.offer(new int[]{newX, newY});
                }
            }

            result[i] = bricks.stream().filter(brick -> !visited[brick[0]][brick[1]]).count();
        }

        return result;
    }

    private static final int[][] dirs = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};
}

