public class Solution {
    public TreeNode subtreeWithAllDeepest(TreeNode root) {
        int maxDepth = 0;
        TreeNode deepestNode = null;
        dfs(root, 1, maxDepth, deepestNode);
        return deepestNode;
    }

    private void dfs(TreeNode node, int depth, int maxDepth, TreeNode deepestNode) {
        if (node == null) {
            return;
        }
        if (depth > maxDepth) {
            maxDepth = depth;
            deepestNode = node;
        }
        dfs(node.left, depth + 1, maxDepth, deepestNode);
        dfs(node.right, depth + 1, maxDepth, deepestNode);
    }
}

