public class Solution {
    public int[][] spiralMatrixIII(int rows, int cols, int y, int x) {
        int[][] result = new int[rows * cols][2];
        int index = 0;
        boolean right = true;
        boolean down = false;
        boolean left = false;
        boolean up = false;

        for (int i = 1; i <= rows * cols; i++) {
            if (right) {
                result[index][0] = y;
                result[index++][1] = x++;
            }
            if (down) {
                result[index][0] = ++y;
                result[index++][1] = x;
            }
            if (left) {
                result[index][0] = y;
                result[index++][1] = --x;
            }
            if (up) {
                result[index][0] = --y;
                result[index++][1] = x;
            }

            if (!right && !down && !left && !up) {
                right = true;
                down = false;
                left = false;
                up = false;
            } else if (right && x == cols || down && y == rows || left && x < 0 || up && y < 0) {
                right = false;
                down = true;
            } else if (down && y == rows || left && x < 0 || up && y < 0) {
                down = false;
                left = true;
            } else if (left && x < 0 || up && y < 0) {
                left = false;
                up = true;
            }
        }

        return result;
    }
}

