public class Solution {
    public int numComponents(ListNode head, int[] nums) {
        HashSet<Integer> set = new HashSet<>();
        for (int i : nums) {
            set.add(i);
        }

        int count = 0;
        boolean connected = false;
        while (head != null) {
            if (set.contains(head.val)) {
                if (!connected) {
                    count++;
                    connected = true;
                }
            } else {
                connected = false;
            }
            head = head.next;
        }

        return count;
    }
}

