import java.util.HashSet;
import java.util.Set;

public class Solution {
    public int subarrayBitwiseORs(int[] arr) {
        Set<Integer> set = new HashSet<>();
        Set<Integer> cur = new HashSet<>();

        for (int num : arr) {
            Set<Integer> next = new HashSet<>();
            for (int x : cur) {
                next.add(x | num);
            }
            next.add(num);
            set.addAll(next);
            cur = next;
        }

        return set.size();
    }
}

