import com.github.leetcode.TreeNode;
import java.util.ArrayList;
import java.util.List;

public class Solution {
    public boolean leafSimilar(TreeNode root1, TreeNode root2) {
        List<Integer> leaves1 = getLeafValues(root1);
        List<Integer> leaves2 = getLeafValues(root2);

        return Objects.equals(leaves1, leaves2);
    }

    private List<Integer> getLeafValues(TreeNode node) {
        if (node == null) {
            return new ArrayList<>();
        }

        List<Integer> leafValues = new ArrayList<>();

        if (node.left == null && node.right == null) {
            leafValues.add(node.val);
        } else {
            leafValues.addAll(getLeafValues(node.left));
            leafValues.addAll(getLeafValues(node.right));
        }

        return leafValues;
    }
}

