import java.util.PriorityQueue;

public class Solution {
    public int minRefuelStops(int target, int startFuel, int[][] stations) {
        PriorityQueue<Integer> pq = new PriorityQueue<>((a, b) -> b - a);
        int curPos = 0;
        int res = 0;
        while (curPos < target) {
            startFuel = Math.max(startFuel, curPos);
            while (!stations.isEmpty() && stations[0][0] <= startFuel) {
                pq.offer(stations[0][1]);
                stations[0][0]++;
                if (stations[0][0] >= stations.length)
                    stations[0][0] = Integer.MAX_VALUE;
                else
                    stations[0][1] += stations[1][1];
            }
            if (!pq.isEmpty()) {
                startFuel += pq.poll();
                res++;
            } else return -1;
        }
        return res;
    }
}

