        Arrays.sort(people);
        int left = 0, right = people.length - 1;
        int count = 0;

        while (left <= right) {
            if (people[left] + people[right] > limit) {
                count++;
                right--;
            } else {
                count++;
                left++;
                right--;
            }
        }

