import java.util.Arrays;
import java.util.Comparator;

public class Solution {
    public int maxProfitAssignment(int[] difficulty, int[] profit, int[] worker) {
        Integer[] jobs = new Integer[difficulty.length];
        for (int i = 0; i < difficulty.length; i++) {
            jobs[i] = i;
        }
        Arrays.sort(jobs, Comparator.comparingInt(i -> difficulty[i]));
        Arrays.sort(worker);

        long maxProfit = 0;
        int jobIndex = 0;

        for (int w : worker) {
            while (jobIndex < difficulty.length && difficulty[jobs[jobIndex]] <= w) {
                maxProfit += profit[jobs[jobIndex]];
                jobIndex++;
            }
            if (jobIndex > 0) {
                maxProfit -= profit[jobs[jobIndex - 1]];
            }
        }

        return (int) maxProfit;
    }
}

