public class Solution {
    public boolean lemonadeChange(int[] bills) {
        int five = 0, ten = 0;
        for (int bill : bills) {
            if (bill == 5) {
                five++;
            } else if (bill == 10) {
                ten++;
                five--;
            } else if (five > 0 && ten > 0) {
                ten--;
                five--;
            } else if (bill == 20 && five < 3) {
                return false;
            } else if (bill == 20) {
                five -= 3;
            }
        }
        return true;
    }
}

