        if (k == 1) {
            StringBuilder sb = new StringBuilder(s);
            for (int i = s.length() - 1; i > 0; i--) {
                char minChar = sb.charAt(i);
                for (int j = i - 1; j >= 0; j--) {
                    if (sb.charAt(j) < minChar) {
                        minChar = sb.charAt(j);
