import java.util.HashMap;
import java.util.Map;

public class Solution {
    public boolean reorderedPowerOf2(int n) {
        String s = Integer.toString(n);
        Map<Character, Integer> map = new HashMap<>();
        for (char c : s.toCharArray()) {
            map.put(c, map.getOrDefault(c, 0) + 1);
        }

        int count = 0;
        while (count <= 31 && (1 << count) != 0) {
            Map<Character, Integer> tempMap = new HashMap<>(map);
            String powerOfTwo = Integer.toString(1 << count);
            for (char c : powerOfTwo.toCharArray()) {
                if (!tempMap.containsKey(c)) return false;
                else tempMap.put(c, tempMap.get(c) - 1);
                if (tempMap.get(c) == 0) tempMap.remove(c);
            }
            count++;
        }

        return true;
    }
}

