public class Solution {
    public int expressiveWords(String s, String[] words) {
        return (int) words.stream()
                .filter(word -> canTransform(s, word))
                .count();
    }

    private boolean canTransform(String source, String target) {
        if (source.length() != target.length()) return false;
        int i = 0, j = 0;
        while (i < source.length()) {
            int countS = 1;
            while (i + 1 < source.length() && source.charAt(i) == source.charAt(i + 1)) {
                i++;
                countS++;
            }
            int countT = 1;
            while (j + 1 < target.length() && target.charAt(j) == target.charAt(j + 1)) {
                j++;
                countT++;
            }
            if (countS != countT && (countS < 3 || countT < 3 || countS < countT)) return false;
            i++; j++;
        }
        return true;
    }
}

