public class Solution {
    public int minSwap(int[] listA, int[] listB) {
        int n = listA.length;
        int[] dp1 = new int[n];
        int[] dp2 = new int[n];

        for (int i = 0; i < n; i++) {
            if (i == 0 || listA[i] > listA[i - 1] && listB[i] > listB[i - 1]) {
                dp1[i] = 1;
                dp2[i] = 1;
            }
            if (i > 0 && listA[i] > listB[i - 1] && listB[i] > listA[i - 1]) {
                dp1[i] = Math.min(dp1[i], dp2[i - 1] + 1);
                dp2[i] = Math.min(dp2[i], dp1[i - 1] + 1);
            }
        }

        return Math.min(dp1[n - 1], dp2[n - 1]);
    }
}

