import java.util.*;

public class Solution {
    public int numSimilarGroups(String[] strs) {
        int n = strs.length;
        boolean[][] similar = new boolean[n][n];
        for (int i = 0; i < n; i++) {
            for (int j = i + 1; j < n; j++) {
                if (isSimilar(strs[i], strs[j])) {
                    similar[i][j] = similar[j][i] = true;
                }
            }
        }

        int count = 0;
        boolean[] visited = new boolean[n];
        for (int i = 0; i < n; i++) {
            if (!visited[i]) {
                dfs(i, similar, visited);
                count++;
            }
        }
        return count;
    }

    private void dfs(int node, boolean[][] similar, boolean[] visited) {
        visited[node] = true;
        for (int i = 0; i < similar.length; i++) {
            if (!visited[i] && similar[node][i]) {
                dfs(i, similar, visited);
            }
        }
    }

    private boolean isSimilar(String s1, String s2) {
        int diffCount = 0;
        for (int i = 0; i < s1.length(); i++) {
            if (s1.charAt(i) != s2.charAt(i)) {
                diffCount++;
                if (diffCount > 2) return false;
            }
        }
        return true;
    }
}

