import java.util.HashMap;
import java.util.Map;

public class Solution {
    public int uniqueLetterString(String s) {
        Map<Character, Integer> lastCharIdx = new HashMap<>();
        Map<Character, Integer> prevLastCharIdx = new HashMap<>();

        for (int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);
            if (!lastCharIdx.containsKey(c)) {
                lastCharIdx.put(c, i + 1);
            } else {
                int count = lastCharIdx.get(c) - prevLastCharIdx.getOrDefault(c, 0);
                result += count;
                lastCharIdx.put(c, i + 1);
            }
            prevLastCharIdx.put(c, lastCharIdx.get(c));
        }

        return result;
    }

    private int result = 0;
}

