            for (int j = 1; j < n; j++) {
                score = score * 2 + grid[i][j];
            }
        }

        return score;
    }

    private void reverseRow(int[][] grid, int row) {
        for (int i = 0; i < grid[row].length; i++) {
            if (grid[row][i] == 1) {
                grid[row][i] = 0;
            } else {
                grid[row][i] = 1;
            }
        }
    }

    private void reverseCol(int[][] grid, int col) {
        for (int i = 0; i < grid.length; i++) {
            if (grid[i][col] == 1) {
                grid[i][col] = 0;
            } else {
                grid[i][col] = 1;
            }
        }
    }
}

