import com_github_leetcode.TreeNode;
import java.util.*;

public class Solution {
    public List<Integer> distanceK(TreeNode root, TreeNode target, int k) {
        Map<TreeNode, List<TreeNode>> graph = new HashMap<>();
        buildGraph(root, null, graph);

        Queue<TreeNode> queue = new LinkedList<>();
        Set<TreeNode> visited = new HashSet<>();
        queue.offer(target);
        visited.add(target);

        while (!queue.isEmpty()) {
            TreeNode node = queue.poll();
            if (k > 0) {
                k--;
                continue;
            }

            List<Integer> result = new ArrayList<>();
            dfs(node, graph, visited, result);
            return result;
        }

        return null;
    }

    private void buildGraph(TreeNode root, TreeNode parent, Map<TreeNode, List<TreeNode>> graph) {
        if (root == null) return;

        if (!graph.containsKey(root)) graph.put(root, new ArrayList<>());

        if (parent != null) graph.get(parent).add(root);
        if (root.left != null) {
            graph.get(root).add(root.left);
            buildGraph(root.left, root, graph);
        }
        if (root.right != null) {
            graph.get(root).add(root.right);
            buildGraph(root.right, root, graph);
        }
    }

    private void dfs(TreeNode node, Map<TreeNode, List<TreeNode>> graph, Set<TreeNode> visited, List<Integer> result) {
        if (!graph.containsKey(node)) return;

        for (TreeNode neighbor : graph.get(node)) {
            if (!visited.contains(neighbor)) {
                visited.add(neighbor);
                result.add(neighbor.val);
                dfs(neighbor, graph, visited, result);
            }
        }
    }
}

