public class Solution {
    public boolean buddyStrings(String s, String goal) {
        if (s.length() != goal.length()) return false;

        int diffCount = 0;
        int[] diffIndices = new int[2];

        for (int i = 0; i < s.length(); i++) {
            if (s.charAt(i) != goal.charAt(i)) {
                diffCount++;

                if (diffCount > 2) return false;

                diffIndices[diffCount - 1] = i;
            }
        }

        if (diffCount == 0) {
            for (int i = 0; i < s.length(); i++) {
                if (s.indexOf(s.charAt(i)) != goal.indexOf(s.charAt(i))) return false;
            }

            return true;
        } else if (diffCount == 2) {
            int[] indices = diffIndices;
            char temp = s.charAt(indices[0]);
            s = s.substring(0, indices[0]) + s.charAt(indices[1]) + s.substring(indices[0] + 1, indices[1]) 
                + temp + s.substring(indices[1] + 1);

            return s.equals(goal);
        } else {
            return false;
        }
    }
}

