public class Solution {
    public String shiftingLetters(String s, int[][] shifts) {
        long[] prefixSum = new long[shifts.length + 1];
        for (int i = shifts.length - 1; i >= 0; i--) {
            prefixSum[i] = shifts[i][2] + prefixSum[i + 1];
        }

        StringBuilder sb = new StringBuilder();
        int n = s.length();
        for (int i = 0; i < n; i++) {
            long shift = prefixSum[0];
            if (i > 0) {
                shift -= prefixSum[i];
            }

            char c = s.charAt(i);
            int asciiVal = (int)c;
            asciiVal += (shift % 26);
            if (asciiVal > 'z') {
                asciiVal -= 26;
            } else if (asciiVal < 'a') {
                asciiVal += 26;
            }

            sb.append((char)asciiVal);
            prefixSum[0] = shift;
        }

        return sb.toString();
    }
}

