public class Solution {
    public int numberOfWays(int startPos, int endPos, int k) {
        int diff = Math.abs(endPos - startPos);
        if (k < diff || (k - diff) % 2 != 0) return 0;

        int n = k - diff;
        long res = 1;
        for (int i = 1; i <= n / 2; i++) {
            res = res * (n + 1 - 2 * i) * (n + 1 - 2 * i) % (1000000007);
        }

        return (int)(res / (factorial(n / 2, 1000000007) * factorial(n / 2, 1000000007) % 1000000007));
    }

    private long factorial(int n, int mod) {
        long res = 1;
        for (int i = 2; i <= n; i++) {
            res = res * i % mod;
        }
        return res;
    }
}

