public class Solution {
    public long taskSchedulerII(int[] tasks, int space) {
        Map<Integer, Integer> lastTask = new HashMap<>();
        long days = 0;

        for (int task : tasks) {
            if (!lastTask.containsKey(task) || days - lastTask.get(task) >= space) {
                lastTask.put(task, days);
                days++;
            } else {
                int nextAvailableDay = lastTask.get(task) + space;
                long remainingDays = nextAvailableDay - days;
                days += remainingDays + 1;
                lastTask.put(task, days);
                days++;
            }
        }

        return days;
    }
}

