import java.util.HashMap;
import java.util.Map;

public class Solution {
    public long countPairs(int n, int[][] edges) {
        Map<Integer, Integer> parent = new HashMap<>();
        for (int i = 0; i < n; i++) {
            parent.put(i, i);
        }

        int[] rank = new int[n];

        for (int[] edge : edges) {
            int u = find(parent, edge[0]);
            int v = find(parent, edge[1]);

            if (u != v) {
                union(parent, rank, u, v);
            }
        }

        long count = 0;
        for (int i = 0; i < n; i++) {
            if (find(parent, i) == i) {
                count += getConnectedComponents(parent, rank).size();
            }
        }

        return count - n;
    }

    private int find(Map<Integer, Integer> parent, int x) {
        if (parent.get(x) != x) {
            parent.put(x, find(parent, parent.get(x)));
        }
        return parent.get(x);
    }

    private void union(Map<Integer, Integer> parent, int[] rank, int u, int v) {
        int rootU = find(parent, u);
        int rootV = find(parent, v);

        if (rootU != rootV) {
            if (rank[rootU] < rank[rootV]) {
                parent.put(rootU, rootV);
            } else if (rank[rootU] > rank[rootV]) {
                parent.put(rootV, rootU);
            } else {
                parent.put(rootV, rootU);
                rank[rootU]++;
            }
        }
    }

    private int getConnectedComponents(Map<Integer, Integer> parent, int[] rank) {
        Map<Integer, Integer> connectedComponents = new HashMap<>();
        for (int i = 0; i < parent.size(); i++) {
            if (parent.get(i) == i && !connectedComponents.containsKey(parent.get(i))) {
                connectedComponents.put(parent.get(i), 1);
            }
        }
        return connectedComponents.size();
    }
}

