public class Solution {
    public int maximumRobots(int[] chargeTimes, int[] runningCosts, long budget) {
        int n = chargeTimes.length;
        int[] prefixSum = new int[n + 1];
        for (int i = 0; i < n; i++) {
            prefixSum[i + 1] = prefixSum[i] + runningCosts[i];
        }
        PriorityQueue<Integer> maxHeap = new PriorityQueue<>((a, b) -> a - b);
        int left = 0;
        long sum = 0;
        for (int right = 0; right < n; right++) {
            sum += chargeTimes[right];
            maxHeap.offer(chargeTimes[right]);
            while (sum * (right - left + 1) + maxHeap.peek() > budget) {
                sum -= chargeTimes[left++];
                maxHeap.poll();
            }
            if (right - left + 1 > n - right) {
                n = right - left + 1;
            }
        }
        return n;
    }
}

