public class Solution {
    public int closestMeetingNode(int[] edges, int node1, int node2) {
        Map<Integer, Integer> dist1 = new HashMap<>();
        Map<Integer, Integer> dist2 = new HashMap<>();

        Queue<Integer> q1 = new LinkedList<>();
        Queue<Integer> q2 = new LinkedList<>();

        q1.offer(node1);
        q2.offer(node2);

        while (!q1.isEmpty() || !q2.isEmpty()) {
            if (dist1.containsKey(q1.peek())) {
                int node = q1.poll();
                dist1.put(node, -1);
            } else {
                int node = q1.poll();
                dist1.put(node, 0);
                int nextNode = edges[node];
                if (nextNode != -1) {
                    q1.offer(nextNode);
                    dist1.put(nextNode, dist1.get(node) + 1);
                }
            }

            if (dist2.containsKey(q2.peek())) {
                int node = q2.poll();
                dist2.put(node, -1);
            } else {
                int node = q2.poll();
                dist2.put(node, 0);
                int nextNode = edges[node];
                if (nextNode != -1) {
                    q2.offer(nextNode);
                    dist2.put(nextNode, dist2.get(node) + 1);
                }
            }

            for (int key : dist1.keySet()) {
                if (dist2.containsKey(key)) {
                    int maxDist = Math.max(dist1.get(key), dist2.get(key));
                    if (maxDist < Integer.MAX_VALUE / 2) {
                        return key;
