public class Solution {
    public int peopleAwareOfSecret(int n, int delay, int forget) {
        long MOD = (long) 1e9 + 7;
        long[] dp = new long[n + 2];
        for (int i = 0; i <= n; i++) {
            if (i >= delay && i - delay < forget) {
                dp[i] = (dp[i - delay] + dp[i]) % MOD;
            } else if (i >= delay) {
