        int max = 0;
        for (int i = 0; i < (1 << n); i++) {
            int[] child = new int[k];
            int unfairness = 0;
            for (int j = 0; j < n; j++) {
                if ((i & (1 << j)) != 0) {
                    child[j % k] += cookies[j];
