class Solution {
    private static final int MOD = (int) 1e9 + 7;
    private Map<String, Integer> memo;

    public int countPaths(int[][] grid) {
        memo = new HashMap<>();
        int m = grid.length;
        int n = grid[0].length;
        long[] dp = new long[m * n];
        for (int i = 0; i < m * n; i++) {
            dp[i] = -1;
        }
        return (int) dfs(0, 0, grid, dp);
    }

    private int dfs(int x, int y, int[][] grid, long[] dp) {
        if (x < 0 || y < 0 || x >= grid.length || y >= grid[0].length) {
            return 0;
        }
        String key = x + "," + y;
        if (memo.containsKey(key)) {
            return memo.get(key);
        }
        int[][] directions = {{1, 0}, {-1, 0}, {0, 1}, {0, -1}};
        long count = 0;
        for (int[] dir : directions) {
            int newX = x + dir[0];
            int newY = y + dir[1];
            if (grid[newX][newY] > grid[x][y]) {
                count += dfs(newX, newY, grid, dp);
            }
        }
        dp[x * n + y] = count;
        memo.put(key, (int) (count % MOD));
        return memo.get(key);
    }
}

