public class Solution {
    public long kSum(int[] nums, int k) {
        Arrays.sort(nums);
        PriorityQueue<Long> pq = new PriorityQueue<>((a, b) -> Long.compare(b, a));
        long sum = 0;
        for (int num : nums) {
            sum += num;
            pq.offer(sum);
            if (pq.size() > k) {
                pq.poll();
            }
        }
        return pq.peek();
    }
