public class Solution {
    int[] parent;
    int[] size;
    int totalXor = 0;
    boolean[] blocked;

    public int minimumScore(int[] nums, int[][] edges) {
        int n = nums.length;
        parent = new int[n];
        size = new int[n];
        blocked = new boolean[n];

        for (int i = 0; i < n; i++) {
            parent[i] = i;
            size[i] = 1;
        }

        for (int[] edge : edges) {
            union(edge[0], edge[1]);
            totalXor ^= nums[edge[0]] ^ nums[edge[1]];
        }

        int minScore = Integer.MAX_VALUE;

        for (int[] edge : edges) {
            int src = find(edge[0]);
            int nbr = find(edge[1]);

            if (src != nbr && !blocked[src] && !blocked[nbr]) {
                int xor1 = get(src);
                blocked[src] = true;
                minScore = Math.min(minScore, 2 * totalXor - xor1 - get(nbr));
                blocked[src] = false;

                trySecondEdge(edge[0], edge[1]);
            }
        }

        return minScore;
    }

    private void union(int x, int y) {
        int rootX = find(x);
        int rootY = find(y);

        if (rootX != rootY) {
            parent[rootY] = rootX;
            size[rootX] += size[rootY];
        }
    }

    private int find(int x) {
        while (x != parent[x]) {
            parent[x] = parent[parent[x]];
            x = parent[x];
        }
        return x;
    }

    private void trySecondEdge(int src, int nbr) {
        int xor1 = get(src);
        blocked[src] = true;

        for (int[] edge : edges) {
            if (!blocked[edge[0]] && !blocked[edge[1]]) {
                int rootSrc = find(edge[0]);
                int rootNbr = find(edge[1]);

                if ((rootSrc == src || rootSrc == nbr) && (rootNbr != src && rootNbr != nbr)) {
                    int xor2 = get(rootNbr);
                    int xor3 = totalXor ^ xor1 ^ xor2;
                    minScore = Math.min(minScore, Math.max(xor3, Math.max(xor1, xor2)) - Math.min(xor3, Math.min(xor1, xor2)));
                } else if ((rootSrc != src && rootSrc != nbr) && (rootNbr == src || rootNbr == nbr)) {
                    int xor2 = get(src);
                    int xor3 = totalXor ^ xor1 ^ xor2;
                    minScore = Math.min(minScore, Math.max(xor3, Math.max(xor1, xor2)) - Math.min(xor3, Math.min(xor1, xor2)));
                } else if (rootSrc != src && rootNbr != nbr) {
                    int xor2 = get(src);
                    int xor3 = get(nbr);
                    minScore = Math.min(minScore, Math.max(totalXor ^ xor1 ^ xor2, Math.max(xor1, xor3)) - Math.min(totalXor ^ xor1 ^ xor2, Math.min(xor1, xor3)));
                }
            }
        }

        blocked[src] = false;
    }

    private int get(int x) {
        if (parent[x] == x)
            return totalXor;

        return get(parent[x]) ^ nums[x];
    }

    List<int[]> edges = new ArrayList<>();
}

