            parent[rootY] = rootX;
            size[rootX] += size[rootY];
            maxSum[rootX] = Math.max(maxSum[rootX], maxSum[rootY]);
        }
    }

    private void updateMaxSum(int x) {
        int root = find(x);
        maxSum[root] = Math.max(maxSum[root], getSum(x));
    }

    private int getSum(int x) {
        int sum = 0;
        while (x >= 0) {
            sum += parent[x];
            x = parent[x] - 1;
        }
        return sum;
    }

    public int[] getMaxSegmentSums(int[] nums, int[] removeQueries) {
        int n = nums.length;

        UF uf = new UF(n);
        for (int i = 0; i < n; i++) {
            uf.insert(i, nums[i]);
        }

        int[] answer = new int[removeQueries.length];
        for (int i = 0; i < removeQueries.length; i++) {
            int index = removeQueries[i];

            uf.insert(index, -1);
            answer[i] = uf.maxSum[uf.find(index)];
        }
        return answer;
    }
}

