public class Solution {
    public boolean validPartition(int[] nums) {
        int n = nums.length;
        boolean[][] dp = new boolean[n][4];

        for (int i = 0; i < n; i++) {
            if (i > 0 && nums[i] == nums[i - 1]) {
                dp[i][2] |= dp[i - 1][2];
                dp[i][3] |= dp[i - 1][3];
            }

            if (i >= 2 && nums[i] == nums[i - 2]) {
                dp[i][2] |= dp[i - 2][2];
                dp[i][3] |= dp[i - 2][3];
            }

            if (i > 1 && nums[i] == nums[i - 1] + 1 && nums[i - 1] == nums[i - 2] + 1) {
