import java.util.Arrays;
import java.util.PriorityQueue;

public class Solution {
    public long minSumSquareDiff(int[] nums1, int[] nums2, int k1, int k2) {
        int n = nums1.length;
        long[] diff = new long[n];
        for (int i = 0; i < n; i++) {
            diff[i] = (long) (nums1[i] - nums2[i]) * (nums1[i] - nums2[i]);
        }
        Arrays.sort(diff);
        PriorityQueue<Integer> pq = new PriorityQueue<>((a, b) -> b - a);

        long totalDifferences = 0;
        for (int i : diff) {
            totalDifferences += i;
        }

        int kSum = k1 + k2;

        if (kSum < totalDifferences) {
            pq.addAll(Arrays.stream(diff).boxed().mapToInt(i -> i).toArray());
            while (!pq.isEmpty() && kSum > 0) {
                long diffVal = pq.poll();
                if (diffVal <= kSum) {
                    kSum -= (int) diffVal;
                    totalDifferences -= diffVal;
                } else {
                    int moveCount = (int) (kSum + 1);
                    totalDifferences -= moveCount * (moveCount - 1) / 2L;
                    break;
                }
            }
        }

        return totalDifferences;
    }
}

