        return helper(matrix, numSelect, 0, m, selected);
    }

    private int helper(int[][] matrix, int numSelect, int start, int m, boolean[] selected) {
        if (numSelect == 0) {
            int count = 0;
            for (int i = 0; i < m; i++) {
                boolean isCovered = true;
                for (int j = 0; j < matrix[i].length; j++) {
                    if (matrix[i][j] == 1 && !selected[j]) {
