import java.util.*;

public class Solution {
    public int[][] buildMatrix(int k, int[][] rowC, int[][] colC) {
        // base case: when the length of row or col is less than k, return empty.
        if (rowC.length < k || colC.length < k) {
            return new int[0][];
        }

        Map<Integer, List<Integer>> graph = new HashMap<>();
        for (int i = 1; i <= k; i++) {
            graph.put(i, new ArrayList<>());
        }
        for (int[] condition : rowC) {
            graph.get(condition[0]).add(condition[1]);
        }
        for (int[] condition : colC) {
            graph.get(condition[0]).add(condition[1]);
        }

        int[] indegree = new int[k + 1];
        for (List<Integer> neighbors : graph.values()) {
            for (Integer neighbor : neighbors) {
                indegree[neighbor]++;
            }
        }

        Queue<Integer> queue = new LinkedList<>();
        for (int i = 1; i <= k; i++) {
            if (indegree[i] == 0) {
                queue.offer(i);
            }
        }

        int[][] matrix = new int[k][k];
        while (!queue.isEmpty()) {
            int node = queue.poll();
            List<Integer> neighbors = graph.get(node);
            for (Integer neighbor : neighbors) {
                indegree[neighbor]--;
                if (indegree[neighbor] == 0) {
                    queue.offer(neighbor);
                }
                matrix[(node - 1) / k][(node - 1) % k] = neighbor;
            }
        }

        // check if there is a loop in the graph
        for (int i = 1; i <= k; i++) {
            if (indegree[i] != 0) {
                return new int[0][];
            }
        }

        return matrix;
    }
}

