public class Solution {
    public int[] smallestTrimmedNumbers(String[] nums, int[][] queries) {
        Map<String, List<Integer>> map = new HashMap<>();

        for (int i = 0; i < nums.length; i++) {
            String trimmedNum = trim(nums[i], queries[0][1]);
            if (!map.containsKey(trimmedNum)) {
                map.put(trimmedNum, new ArrayList<>());
            }
            map.get(trimmedNum).add(i);
        }

        int[] answer = new int[queries.length];

        for (int i = 0; i < queries.length; i++) {
            String trimmedNum = trim(nums[queries[i][1]], queries[i][0]);
            List<Integer> indices = map.get(trimmedNum);

            if (indices.size() >= queries[i][0]) {
                answer[i] = indices.get(queries[i][0] - 1);
            } else {
                answer[i] = -1;
            }
        }

        return answer;
    }

    private String trim(String num, int k) {
        while (num.length() > k && num.charAt(num.length() - k - 1) == '0') {
            num = num.substring(1);
        }

        if (num.length() <= k) {
            num += new String(new char[k - num.length() + 1]).replace("\0", "0");
        } else {
            num = num.substring(num.length() - k);
        }

        return num;
    }
}

