public class Solution {
    public int longestSubsequence(String s, int k) {
        int n = s.length();
        int[] dp = new int[n + 1];
        for (int i = 0; i <= n; i++) {
            dp[i] = -1;
        }
        return helper(s, k, 0, dp);
    }

    public int helper(String s, int k, int idx, int[] dp) {
        if (k == 0) {
            return 0;
        }
        if (idx >= s.length()) {
            return Integer.MIN_VALUE;
        }
        if (dp[idx] != -1) {
            return dp[idx];
        }

        int ans = helper(s, k, idx + 1, dp);
        if (s.charAt(idx) == '1') {
            ans = Math.max(ans, 1 + helper(s, k / 2, idx + 1, dp));
        }
        dp[idx] = Math.max(ans, helper(s, k, idx + 1, dp));
        return dp[idx];
    }
}

