public class Solution {
    public int longestSubarray(int[] nums) {
        int n = nums.length;
        int maxAnd = 0, curAnd = 0;
        int[] dp = new int[n];

        for (int i = 0; i < n; i++) {
            curAnd |= nums[i];
            if (curAnd > maxAnd) {
                maxAnd = curAnd;
                dp[i] = 1;
            } else if (curAnd == maxAnd) {
                dp[i] = dp[i - 1] + 1;
            }
        }

        int res = dp[n - 1];
        for (int i = n - 2; i >= 0; i--) {
            curAnd ^= nums[i + 1];
            if ((curAnd & maxAnd) == maxAnd) {
                res = Math.max(res, dp[i] + (n - i - 1));
            }
        }

        return res;
    }
}

