public class Solution {
    public int[][] onesMinusZeros(int[][] grid) {
        int m = grid.length;
        int n = grid[0].length;

        // Calculate the number of ones and zeros in each row.
        int[] rowOnes = new int[m];
        int[] rowZeros = new int[m];
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 1) {
                    rowOnes[i]++;
                } else {
                    rowZeros[i]++;
                }
            }
        }

        // Calculate the number of ones and zeros in each column.
        int[] colOnes = new int[n];
        int[] colZeros = new int[n];
        for (int j = 0; j < n; j++) {
            for (int i = 0; i < m; i++) {
                if (grid[i][j] == 1) {
                    colOnes[j]++;
                } else {
                    colZeros[j]++;
                }
            }
        }

        // Create the difference matrix.
        int[][] diff = new int[m][n];
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                diff[i][j] = rowOnes[i] + colOnes[j] - rowZeros[i] - colZeros[j];
            }
        }

        return diff;
    }
}

