public class Solution {
    public int subarrayGCD(int[] nums, int k) {
        Map<Integer, Integer> map = new HashMap<>();
        int count = 0;
        for (int i = 0; i < nums.length; i++) {
            int gcd = nums[i];
            for (int j = i + 1; j < nums.length; j++) {
                gcd = gcd(gcd, nums[j]);
                if (gcd == k) count++;
                map.put(gcd, map.getOrDefault(gcd, 0) + 1);
            }
        }
        return count;
