public class Solution {
    public long makeSimilar(int[] nums, int[] target) {
        Map<Integer, Integer> numCount = new HashMap<>();
        for (int num : nums) {
            numCount.put(num % 2, numCount.getOrDefault(num % 2, 0) + 1);
        }

        Map<Integer, Integer> targetCount = new HashMap<>();
        for (int num : target) {
            targetCount.put(num % 2, targetCount.getOrDefault(num % 2, 0) + 1);
        }

        long operations = 0;
        for (Map.Entry<Integer, Integer> entry : numCount.entrySet()) {
            int diff = Math.abs(entry.getValue() - targetCount.getOrDefault(entry.getKey(), 0));
            if (diff % 2 == 1) {
                operations += diff / 2 + 1;
            } else {
                operations += diff / 2;
            }
        }

        return operations;
    }
}

