public class Solution {
    Map<Integer, Integer> heightMap = new HashMap<>();
    Map<Integer, List<Integer>> graph = new HashMap<>();

    public int[] treeQueries(TreeNode root, int[] queries) {
        dfs(root, null);
        for (int i : queries) {
            heightMap.put(i, -1);
        }
        int[] res = new int[queries.length];
        for (int i = 0; i < queries.length; i++) {
            res[i] = query(queries[i]);
        }
        return res;
    }

    private void dfs(TreeNode node, TreeNode parent) {
        if (node == null) return;
        heightMap.put(node.val, Math.max(heightMap.getOrDefault(node.val, 0), graph.getOrDefault(node.val, new ArrayList<>()).size()));
        for (int child : graph.getOrDefault(node.val, new ArrayList<>())) {
            dfs(graph.get(child).get(0), node);
        }
    }

    private int query(int val) {
        if (!heightMap.containsKey(val)) return 0;
        int height = heightMap.get(val);
        List<Integer> children = graph.getOrDefault(val, new ArrayList<>());
        for (int child : children) {
            height += query(child);
        }
        return height;
    }

    public class Solution {
        int val;
        TreeNode left;
        TreeNode right;

        TreeNode() {}

        TreeNode(int val) { this.val = val; }

        TreeNode(int val, TreeNode left, TreeNode right) {
            this.val = val;
            this.left = left;
            this.right = right;
        }
    }
}

