public class Solution {
    public String oddString(String[] w) {
        int n = w[0].length();
        for (int i = 0; i < n - 1; i++) {
            int[] diff = new int[n - 1];
            for (int j = 0; j < n - 1; j++) {
                if (j == i) continue;
                diff[j] = w[0].charAt(j + 1) - w[0].charAt(j);
            }
            boolean isOdd = true;
            for (String word : w) {
