                for (int j = 0; j < n - 1; j++) {
                    if (j == i) continue;
                    currDiff[j] = word.charAt(j + 1) - word.charAt(j);
                }
                if (!isSame(diff, currDiff)) {
                    isOdd = false;
                    break;
                }
            }
            if (isOdd) return w[0];
        }
        return "";
    }

    private boolean isSame(int[] a, int[] b) {
        for (int i = 0; i < a.length; i++) {
