import java.util.PriorityQueue;
import java.util.Comparator;

public class Solution {
    public long totalCost(int[] costs, int k, int candidates) {
        PriorityQueue<Integer> left = new PriorityQueue<>(Comparator.comparingInt(a -> a));
        PriorityQueue<Integer> right = new PriorityQueue<>(Comparator.comparingInt(a -> a));

        for (int i = 0; i < costs.length; i++) {
            if (i < candidates) {
                left.offer(costs[i]);
            } else if (i >= costs.length - candidates) {
                right.offer(costs[i]);
            }
        }

        long totalCost = 0;
        int count = 0;

        while (!left.isEmpty() && !right.isEmpty()) {
            if (count < k / 2) {
                totalCost += left.poll();
                count++;
            } else if (count == k / 2) {
                if (k % 2 != 0) {
                    totalCost += Math.min(left.peek(), right.peek());
                    break;
                }
            } else {
                totalCost += right.poll();
                count++;
            }

            if (!left.isEmpty() && !right.isEmpty()) {
                int leftTop = left.peek();
                int rightTop = right.peek();

                if (leftTop < rightTop) {
                    int temp = left.poll();
                    left.offer(temp);
                } else {
                    int temp = right.poll();
                    right.offer(temp);
                }
            }
        }

        return totalCost;
    }
}

