            for (int[] neighbor : graph.get(node[0])) {
                if (!visited[neighbor[0]] && distance[neighbor[0]] > Math.min(node[1], neighbor[1])) {
                    distance[neighbor[0]] = Math.min(node[1], neighbor[1]);
                    pq.offer(new int[]{neighbor[0], distance[neighbor[0]]});
                }
            }
        }

        return distance[n];
    }
}

