import com_github_leetcode.TreeNode;
import java.util.ArrayDeque;
import java.util.ArrayList;
import java.util.Arrays;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

public class Solution {
    public int minimumOperations(TreeNode root) {
        if (root == null) return 0;

        Map<Integer, List<Integer>> levelMap = new HashMap<>();
        ArrayDeque<TreeNode> queue = new ArrayDeque<>();
        queue.offer(root);
        int level = 1;

        while (!queue.isEmpty()) {
            int size = queue.size();
            List<Integer> currentLevel = new ArrayList<>();

            for (int i = 0; i < size; i++) {
                TreeNode node = queue.poll();

                if (!levelMap.containsKey(level)) {
                    levelMap.put(level, currentLevel);
                }

                currentLevel.add(node.val);

                if (node.left != null) {
                    queue.offer(node.left);
                }
                if (node.right != null) {
                    queue.offer(node.right);
                }
            }

            Arrays.sort(currentLevel.toArray(new Integer[0]));
            level++;
        }

        int operations = 0;

        for (Map.Entry<Integer, List<Integer>> entry : levelMap.entrySet()) {
            List<Integer> currentLevel = entry.getValue();

            if (!isSorted(currentLevel)) {
                operations += binarySearch(currentLevel);
            }
        }

        return operations;
    }

    private boolean isSorted(List<Integer> list) {
        for (int i = 0; i < list.size() - 1; i++) {
            if (list.get(i) >= list.get(i + 1)) {
                return false;
            }
        }

        return true;
    }

    private int binarySearch(List<Integer> list) {
        int low = 0, high = list.size() - 2;

        while (low <= high) {
            int mid = low + (high - low) / 2;

            if (list.get(mid) > list.get(mid + 1)) {
                return mid + 1;
            } else if (list.get(mid) < list.get(mid + 1)) {
                low = mid + 1;
            } else {
                high = mid - 1;
            }
        }

        return 0;
    }
}

