public class Solution {
    public int numberOfPaths(int[][] grid, int k) {
        final int MOD = 1000000007;
        int m = grid.length;
        int n = grid[0].length;
        long[][] dp = new long[m][n];
        dp[0][0] = grid[0][0];

        for (int i = 1; i < m; i++) {
            dp[i][0] = (dp[i - 1][0] * grid[i][0]) % MOD;
        }

        for (int j = 1; j < n; j++) {
            dp[0][j] = (dp[0][j - 1] * grid[0][j]) % MOD;
        }

        for (int i = 1; i < m; i++) {
            for (int j = 1; j < n; j++) {
                dp[i][j] = ((dp[i - 1][j] + dp[i][j - 1]) * grid[i][j]) % MOD;
            }
        }

        long sum = 0;
        for (long[] row : dp) {
            for (int num : row) {
                sum += num;
            }
        }

        int count = 0;
        for (int i = 0; i <= m * n; i++) {
            if ((sum % k == 0 && i % k == 0)) {
                count++;
            }
        }

        return count;
    }
}

