public class Solution {
    public List<Integer> goodIndices(int[] nums, int k) {
        List<Integer> result = new ArrayList<>();
        boolean[] increasing = new boolean[nums.length];
        boolean[] decreasing = new boolean[nums.length];

        for (int i = 1; i < nums.length - 1; i++) {
            if (i >= k && isIncreasing(nums, i, k)) {
                increasing[i] = true;
            }
            if (isDecreasing(nums, i, k)) {
                decreasing[i] = true;
            }
        }

        for (int i = k; i < nums.length - 1; i++) {
            if (increasing[i] && decreasing[i + 1]) {
                result.add(i);
            }
        }

        return result;
    }

    private boolean isIncreasing(int[] nums, int index, int k) {
        for (int i = index - 1; i >= index - k; i--) {
            if (nums[i] < nums[i + 1]) {
                return false;
            }
        }
        return true;
    }

    private boolean isDecreasing(int[] nums, int index, int k) {
        for (int i = index + 1; i <= Math.min(index + k, nums.length - 1); i++) {
            if (nums[i] < nums[i - 1]) {
                return false;
            }
        }
        return true;
    }
}

