public class Solution {
    public int mostProfitablePath(int[][] edges, int bob, int[] amount) {
        int n = amount.length;
        List<List<Integer>> graph = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            graph.add(new ArrayList<>());
        }
        for (int[] edge : edges) {
            graph.get(edge[0]).add(edge[1]);
            graph.get(edge[1]).add(edge[0]);
        }

        int[] parent = new int[n];
        Arrays.fill(parent, -1);
        Queue<Integer> queue = new LinkedList<>();
        queue.offer(0);

        while (!queue.isEmpty()) {
            int node = queue.poll();
            for (int neighbor : graph.get(node)) {
                if (parent[neighbor] == -1) {
                    parent[neighbor] = node;
                    queue.offer(neighbor);
                }
            }
        }

        int[] dp = new int[n];
        Arrays.fill(dp, Integer.MIN_VALUE);

        dfs(graph, amount, bob, 0, parent, dp);

        return dp[0];
    }

    private void dfs(List<List<Integer>> graph, int[] amount, int bob, int node, int[] parent, int[] dp) {
        if (node == bob) {
            return;
        }
        if (graph.get(node).size() == 1 && !graph.get(node).get(0).equals(parent[node])) {
            dp[node] = Math.max(dp[node], amount[node]);
            return;
        }

        for (int neighbor : graph.get(node)) {
            if (neighbor != parent[node]) {
                dfs(graph, amount, bob, neighbor, parent, dp);
                int cost = 0;
                if (dp[neighbor] < 0) {
                    cost = -dp[neighbor];
                } else {
                    cost = dp[neighbor] / 2;
                }
                dp[node] = Math.max(dp[node], cost + amount[node]);
            }
        }
    }
}

