public class Solution {
    private static final int MOD = (int) 1e9 + 7;
    private static final Set<Character> PRIME_DIGITS = new HashSet<>(Arrays.asList('2', '3', '5', '7'));

    public int beautifulPartitions(String s, int k, int minLength) {
