    private long dfs(String s, int k, int minLength, int index, long[] dp) {
        if (index == s.length()) {
            return k == 0 ? 1 : 0;
        }
        if (dp[index] != -1) {
            return dp[index];
        }
        long res = 0;
        for (int i = index + minLength; i <= s.length(); i++) {
            char start = s.charAt(index);
            char end = s.charAt(i - 1);
            if (!PRIME_DIGITS.contains(start) || PRIME_DIGITS.contains(end)) {
                continue;
            }
            res += dfs(s, k - 1, minLength, i, dp);
        }
        return dp[index] = res % MOD;
    }
}

