import java.util.*;

public class Solution {
    public int magnificentSets(int n, int[][] edges) {
        UnionFind uf = new UnionFind(n);
        for (int[] edge : edges) {
            uf.union(edge[0], edge[1]);
        }

        Set<Integer> groups = new HashSet<>();
        for (int i = 0; i < n; i++) {
            groups.add(uf.find(i));
        }

        int maxGroups = groups.size();
        if (maxGroups == 1) return -1;

        int[] groupSizes = new int[maxGroups];
        Arrays.fill(groupSizes, 0);
        for (int i = 0; i < n; i++) {
            groupSizes[uf.find(i)]++;
        }

        int maxGroupSize = Arrays.stream(groupSizes).max().getAsInt();
        return Math.max(maxGroups, maxGroupSize);
    }

    private static class UnionFind {
        private int[] parent;
        private int[] size;

        public UnionFind(int n) {
            parent = new int[n];
            size = new int[n];
            for (int i = 0; i < n; i++) {
                parent[i] = i;
                size[i] = 1;
            }
        }

        public int find(int x) {
            if (parent[x] != x) {
                parent[x] = find(parent[x]);
            }
            return parent[x];
        }

        public void union(int x, int y) {
            int rootX = find(x);
            int rootY = find(y);
            if (rootX == rootY) return;

            if (size[rootX] < size[rootY]) {
                parent[rootX] = rootY;
                size[rootY] += size[rootX];
            } else {
                parent[rootY] = rootX;
                size[rootX] += size[rootY];
            }
        }
    }
}

