public class Solution {
    public int mostBooked(int n, int[][] meetings) {
        Arrays.sort(meetings, (a, b) -> a[0] - b[0]);

        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> a[1] - b[1]);
        for (int i = 0; i < n; i++) {
            pq.offer(new int[]{i, Integer.MAX_VALUE});
        }

        int[] rooms = new int[n];
        Arrays.fill(rooms, -1);

        PriorityQueue<int[]> delayedMeetings = new PriorityQueue<>((a, b) -> a[0] - b[0]);

        for (int i = 0; i < meetings.length; i++) {
            int start = meetings[i][0], end = meetings[i][1];

            while (!pq.isEmpty() && pq.peek()[1] <= start) {
                delayedMeetings.offer(pq.poll());
            }

            if (!delayedMeetings.isEmpty()) {
                int[] meeting = delayedMeetings.poll();
                rooms[meeting[0]] = i;
                pq.offer(new int[]{meeting[0], end});
            } else {
                int roomNum = pq.peek()[0];
                rooms[roomNum] = i;
                pq.offer(new int[]{roomNum, end});
            }
        }

        int maxCount = 0, result = -1;
        for (int i = 0; i < n; i++) {
            if (rooms[i] > maxCount) {
                maxCount = rooms[i];
                result = i;
            } else if (rooms[i] == maxCount && i < result) {
                result = i;
            }
        }

        return result;
    }
}

