import java.util.ArrayList;
import java.util.List;

public class Solution {
    public int[] productQueries(int n, int[][] queries) {
        List<Integer> powers = new ArrayList<>();
        while (n > 0) {
            int i = (int) (Math.log(n) / Math.log(2));
            powers.add((int) Math.pow(2, i));
            n -= (int) Math.pow(2, i);
        }

        long[] prefixSum = new long[powers.size()];
        prefixSum[0] = powers.get(0);
        for (int i = 1; i < powers.size(); i++) {
            prefixSum[i] = (prefixSum[i - 1] * powers.get(i)) % (1000000007);
        }

        int[] answers = new int[queries.length];
        for (int i = 0; i < queries.length; i++) {
            long left = queries[i][0], right = queries[i][1];
            if (left == 0) {
                answers[i] = (int) prefixSum[(int) right];
            } else {
                answers[i] = (int) ((prefixSum[(int) right] * powMod((long) Math.pow(2, left - 1), powers.size() - (int) right)) % (1000000007));
            }
        }

        return answers;
    }

    private long powMod(long base, long exponent) {
        if (exponent == 0) {
            return 1;
        } else if (exponent % 2 == 0) {
            long temp = powMod(base, exponent / 2);
            return (temp * temp) % 1000000007;
        } else {
            long temp = powMod(base, exponent - 1);
            return ((base * temp) % 1000000007);
        }
    }
}

