public class Solution {
    public List<String> findAndReplaceStringArray(String[] words, String[] targetDict) {
        Map<String, Integer> map = new HashMap<>();
        for (int i = 0; i < targetDict.length; i++) {
            map.put(targetDict[i], i);
        }
        List<String> result = new ArrayList<>();
        for (String word : words) {
            boolean found = false;
            for (Map.Entry<String, Integer> entry : map.entrySet()) {
                String dictWord = entry.getKey();
                int index = entry.getValue();
                if (word.equals(dictWord)) {
                    found = true;
                    break;
                }
                int diffCount = 0;
                for (int i = 0; i < word.length(); i++) {
                    if (word.charAt(i) != dictWord.charAt(i)) {
                        diffCount++;
                    }
                    if (diffCount > 2) {
                        break;
                    }
                }
                if (diffCount <= 2) {
                    result.add(word);
                    found = true;
                    break;
                }
            }
            if (!found) {
                int diffCount = 0;
                for (int i = 0; i < word.length(); i++) {
                    boolean foundInDict = false;
                    for (Map.Entry<String, Integer> entry : map.entrySet()) {
                        String dictWord = entry.getKey();
                        if (dictWord.charAt(i) == word.charAt(i)) {
                            foundInDict = true;
                            break;
                        }
                    }
                    if (!foundInDict) {
                        diffCount++;
                    }
                    if (diffCount > 2) {
                        break;
                    }
                }
                if (diffCount <= 2) {
                    result.add(word);
                }
            }
        }
        return result;
