public class Solution {
    public int countPalindromes(String s) {
        long MOD = 1000000007;
        int n = s.length();
        long[] dp = new long[n + 1];
        for (int i = 0; i <= n; i++) {
            dp[i] = 1;
        }
        for (char c : s.toCharArray()) {
            long[] nextDp = new long[n + 1];
            int idx = 0;
            while (idx < n) {
                if (c == s.charAt(idx)) {
                    nextDp[idx + 1] += dp[idx] * 2 % MOD;
                    nextDp[idx + 1] %= MOD;
                    nextDp[idx + 1] += dp[idx + 1];
                    nextDp[idx + 1] %= MOD;
                } else {
                    nextDp[idx + 1] = dp[idx + 1];
                }
                idx++;
            }
            dp = nextDp;
        }
        return (int) dp[n];
    }
}

