public class Solution {
    public ListNode removeNodes(ListNode head) {
        if (head == null || head.next == null) return head;

        ListNode dummy = new ListNode(0);
        dummy.next = head;
        ListNode stack = new ListNode(0);
        int maxVal = Integer.MIN_VALUE;

        while (head != null) {
            while (stack.val < head.val && head.val > maxVal) {
                maxVal = Math.max(maxVal, stack.val);
                ListNode temp = stack.next;
                stack.next = head;
                stack = temp;
            }

            if (head.val <= maxVal) {
                ListNode temp = head.next;
                head.next = null;
                head = temp;
            } else {
                stack = head;
            }

            head = head.next;
        }

