public class Solution {
    public int minimumDeviation(int[] nums) {
        PriorityQueue<Integer> maxHeap = new PriorityQueue<>((a, b) -> b - a);

        for (int num : nums) {
            if (num % 2 == 0) {
                maxHeap.offer(num);
            } else {
                maxHeap.offer(num * 2);
            }
        }

        int minVal = Arrays.stream(nums).min().getAsInt();
        int deviation = Integer.MAX_VALUE;

        while (true) {
            int top = maxHeap.peek();

            if (top < minVal + deviation) {
                deviation = Math.min(deviation, top - minVal);
                break;
            }

            maxHeap.poll();
            if (maxHeap.peek() % 2 == 0) {
                maxHeap.offer(maxHeap.poll() / 2);
            } else {
                break;
            }
        }

        return deviation;
    }
}

