public class Solution {
    public int getMaxGridHappiness(int m, int n, int introvertsCount, int extrovertsCount) {
        return dp(m, n, 0, 0, new Integer[m][n][1 << 10]);
    }

    private int dp(int m, int n, int i, int j, Integer[][][] memo) {
        if (i == m * n) {
            return 0;
        }
        if (memo[i][j][introvertsCount + extrovertsCount] != null) {
            return memo[i][j][introvertsCount + extrovertsCount];
        }

        int max = Integer.MIN_VALUE;

        for (int k = 0; k < 4; k++) {
            int ni = i + k / 2;
            int nj = j + k % 2;
            if (ni >= m || nj >= n) continue;
            int happiness = 0;
            if ((k & 1) == 0) {
                happiness += 120 - (introvertsCount > 0 ? 30 : 0);
                introvertsCount--;
            } else {
                happiness += 40 + (extrovertsCount > 0 ? 20 : 0);
                extrovertsCount--;
            }
            max = Math.max(max, happiness + dp(m, n, ni, nj, memo));
        }

        if ((introvertsCount == 0) && (extrovertsCount == 0)) {
            return Integer.MIN_VALUE;
        } else {
            max += dp(m, n, i + 1, j, memo);
        }
