public class Solution {
    public boolean canDistribute(int[] nums, int[] quantity) {
        Map<Integer, Integer> numCounts = new HashMap<>();
        for (int num : nums) {
            numCounts.put(num, numCounts.getOrDefault(num, 0) + 1);
        }

        Arrays.sort(quantity);

        int n = nums.length;
