import java.util.*;

public class Solution {
    public int minimumIncompatibility(int[] nums, int k) {
        Arrays.sort(nums);
        int n = nums.length;
        if (n % k != 0) return -1;
        long[][] dp = new long[n + 1][k];
        for (long[] row : dp) Arrays.fill(row, Long.MAX_VALUE / 2);
        dp[0][0] = 0;

        for (int i = 1; i <= n; i++) {
            int cur = nums[i - 1];
            long[][] nextDp = new long[n + 1][k];
            for (long[] row : nextDp) Arrays.fill(row, Long.MAX_VALUE / 2);
            for (int j = 0; j < k; j++) {
                if (dp[i - 1][j] == Long.MAX_VALUE / 2) continue;
                int idx = i % k;
                long minVal = cur;
                long maxVal = cur;
                for (int l = 0; l <= n && l * k < i; l++) {
                    if ((l + 1) * k > i) break;
                    if (((j >> l) & 1) == 0) continue;
                    minVal = Math.min(minVal, nums[l]);
                    maxVal = Math.max(maxVal, nums[n - (i - 1 - l * k) - 1]);
                }
                nextDp[i][idx] = Math.min(nextDp[i][idx], dp[i - 1][j] + maxVal - minVal);
            }
            dp = nextDp;
        }

        long ans = Long.MAX_VALUE / 2;
        for (int i = 0; i < k; i++) {
            ans = Math.min(ans, dp[n][i]);
        }
        return ans == Long.MAX_VALUE / 2 ? -1 : (int) ans;
    }
}

