public class Solution {
    public int createSortedArray(int[] instructions) {
        long ans = 0;
        int n = instructions.length;
        int[] bit = new int[n + 1];
        for (int i = 0; i < n; i++) {
            int leftLess = get(bit, instructions[i]);
            int rightGreater = n - 1 - get(bit, instructions[i] - 1);
            ans += Math.min(leftLess, rightGreater);
            update(bit, instructions[i], 1);
        }
        return (int) (ans % (1000000007));
    }

    private void update(int[] bit, int i, int val) {
        while (i < bit.length) {
            bit[i] += val;
            i = i | (i + 1);
        }
    }

    private int get(int[] bit, int i) {
        int res = 0;
        while (i >= 0) {
            res += bit[i];
            i = (i & (i + 1)) - 1;
        }
        return res;
    }
}

