public class Solution {
    public String kthSmallestPath(int[] destination, int k) {
        int row = destination[0];
        int col = destination[1];

        StringBuilder sb = new StringBuilder();
        while (row > 0 || col > 0) {
            if (col < row) {
                for (int i = 0; i < row - col; i++) {
                    sb.append('H');
                }
                sb.append("V");
                row--;
                col--;
            } else {
                int count = comb(col, row);
                if (k <= count) {
                    for (int i = 0; i < col; i++) {
                        sb.append('H');
                    }
                    sb.append("V");
                    row--;
                    col--;
                } else {
                    k -= count;
                    for (int i = 0; i < row - 1; i++) {
                        sb.append('H');
                    }
                    sb.append("V");
                    row--;
                }
            }
        }

        return sb.toString();
    }

    private int comb(int n, int r) {
        if (r > n - r) {
            r = n - r;
        }
        int result = 1;
        for (int i = 0; i < r; i++) {
            result = result * (n - i) / (i + 1);
        }
        return result;
    }
}

