import java.util.*;

public class Solution {
    public int[] countSubgraphsForEachDiameter(int n, int[][] edges) {
        List<Integer>[] graph = new ArrayList[n + 1];
        for (int i = 0; i <= n; i++) {
            graph[i] = new ArrayList<>();
        }

        for (int[] edge : edges) {
            graph[edge[0]].add(edge[1]);
            graph[edge[1]].add(edge[0]);
        }

        int[] res = new int[n - 1];
        Arrays.fill(res, 0);

        for (int i = 1; i <= n; i++) {
            boolean[] visited = new boolean[n + 1];
            Queue<Integer> q = new LinkedList<>();
            q.offer(i);
            visited[i] = true;
            int maxDist = 0;

            while (!q.isEmpty()) {
                int size = q.size();
                for (int j = 0; j < size; j++) {
                    int node = q.poll();
                    maxDist = Math.max(maxDist, getDistance(graph, i, node));

                    for (Integer neighbor : graph[node]) {
                        if (!visited[neighbor]) {
                            visited[neighbor] = true;
                            q.offer(neighbor);
                        }
                    }
                }
            }

            res[maxDist - 1]++;
        }

        return res;
    }

    private int getDistance(List<Integer>[] graph, int u, int v) {
        Queue<int[]> q = new LinkedList<>();
        q.offer(new int[] {u, 0});
        boolean[] visited = new boolean[graph.length];

        while (!q.isEmpty()) {
            int[] nodeDist = q.poll();
            int node = nodeDist[0], dist = nodeDist[1];

            if (node == v) return dist;

            for (int neighbor : graph[node]) {
                if (!visited[neighbor]) {
                    visited[neighbor] = true;
                    q.offer(new int[] {neighbor, dist + 1});
                }
            }
        }

        return -1; // unreachable
    }
}

