public class Solution {
    public String findLexSmallestString(String s, int a, int b) {
        Set<String> visited = new HashSet<>();
        Queue<String> queue = new LinkedList<>();
        queue.offer(s);
        visited.add(s);

        while (!queue.isEmpty()) {
            String curr = queue.poll();
            if (curr.length() == 0) return "";
            StringBuilder sb = new StringBuilder(curr);
            for (int i = 1; i < curr.length(); i += 2) {
                int num = Character.getNumericValue(sb.charAt(i)) + a;
                if (num > 9) num -= 10;
                sb.setCharAt(i, (char) (num + '0'));
            }
            String rotated = rotate(curr, b);
            if (!visited.contains(rotated)) {
                queue.offer(rotated);
                visited.add(rotated);
            }

            StringBuilder temp = new StringBuilder(sb.toString());
            for (int i = 1; i < curr.length(); i += 2) {
                int num = Character.getNumericValue(temp.charAt(i));
                temp.setCharAt(i, (char) ((num + a) % 10 + '0'));
            }
            String rotatedTemp = rotate(temp.toString(), b);
            if (!visited.contains(rotatedTemp)) {
                queue.offer(rotatedTemp);
                visited.add(rotatedTemp);
            }
        }

        return Collections.min(visited);
    }

    private String rotate(String s, int b) {
        StringBuilder sb = new StringBuilder(s);
        b %= s.length();
        sb.delete(sb.length() - b, sb.length());
        sb.reverse();
        sb.insert(0, sb.substring(sb.length() - b));
        return sb.toString();
    }
}

