public class Solution {
    public int visiblePoints(List<List<Integer>> points, int angle, List<Integer> location) {
        int n = points.size();
        int ans = 0;
        double[] angles = new double[n];
        int equalPointCount = 0;

        for (int i = 0; i < n; i++) {
            if (points.get(i).get(0).equals(location.get(0)) && points.get(i).get(1).equals(location.get(1))) {
                angles[i] = 0.0;
                equalPointCount++;
            } else {
                double angle = Math.toDegrees(Math.atan2(points.get(i).get(1) - location.get(1), points.get(i).get(0) - location.get(0)));
                if (angle < 0) {
                    angle += 360;
                }
                angles[i] = angle;
            }
        }

        if (n == equalPointCount) return n;

        Collections.sort(angles);

        int maxPoints = 1;
        for (int i = 1; i < n; i++) {
            double diff = angles[i] - angles[i-1];
            if (diff > angle) break;

            int j = equalPointCount + i;
            while (j < n && angles[j] <= angles[i] + angle) {
                maxPoints = Math.max(maxPoints, ++j);
            }
        }

        return maxPoints;
    }
}

