        int n = code.length;
        int[] result = new int[n];

        for (int i = 0; i < n; i++) {
            if (k == 0) {
                result[i] = 0;
            } else if (k > 0) {
                int sum = 0;
                for (int j = 1; j <= Math.min(k, n - i); j++) {
                    sum += code[(i + j) % n];
                }
                result[i] = sum;
            } else {
                k *= -1;
