                        visited[forward][true] = true;
                        queue.offer(new Pair(forward, true));
                    }
                }

                if (pair.b) {
                    if (!set.contains(backward)) {
                        if (!visited[backward][false]) {
                            visited[backward][false] = true;
                            queue.offer(new Pair(backward, false));
