                }
            }
        }

        int maxQuality = 0;
        String bestCoordinate = "";
        for (Map.Entry<String, Integer> entry : map.entrySet()) {
            if (entry.getValue() > maxQuality) {
                maxQuality = entry.getValue();
                bestCoordinate = entry.getKey();
