public class Solution {
    private static final int MOD = (int) 1e9 + 7;

    public int numberOfSets(int n, int k) {
        long[] dp = new long[k + 1];
        for (int i = 2; i <= Math.min(n, k); i++) {
            dp[i] = (dp[i - 1] * (n - i + 1)) % MOD;
        }

        return (int) ((dp[k] * combinatorial(k, n)) % MOD);
    }

    private long combinatorial(int n, int r) {
        if (r > n) {
            return 0;
        }
        long numerator = factorial(n);
        long denominator = factorial(r) * factorial(n - r);
        return (numerator * pow(denominator, MOD - 2)) % MOD;
    }

    private long factorial(int n) {
        long result = 1;
        for (int i = 2; i <= n; i++) {
            result = (result * i) % MOD;
        }
        return result;
    }

    private long pow(long base, int exponent) {
        if (exponent == 0) {
            return 1;
        }
        long temp = pow(base, exponent / 2);
        if ((exponent & 1) != 0) {
            return (((temp * temp) % MOD) * base) % MOD;
        } else {
            return (temp * temp) % MOD;
        }
    }
}

