public class Solution {

    private int[] parent;
    private int[] size;
    private List<int[]> edgeList;

    public Dsu(int n) {
        this.parent = new int[n];
        this.size = new int[n];

        for (int i = 0; i < n; i++) {
            parent[i] = i;
            size[i] = 1;
        }
    }

    public boolean[] distanceLimitedPathsExist(int[][] edgeList, int[][] queries) {
        Arrays.sort(edgeList, Comparator.comparingInt(a -> a[2]));
        Arrays.sort(queries, Comparator.comparingInt(a -> a[2]));

        this.edgeList = new ArrayList<>(edgeList);
        boolean[] answer = new boolean[queries.length];

        for (int i = 0; i < queries.length; i++) {
            int p = find(queries[i][0]);
            int q = find(queries[i][1]);

            if (p == q) {
                answer[i] = true;
                continue;
            }

            int j = 0;
            while (j < edgeList.size() && edgeList.get(j)[2] >= queries[i][2]) {
                union(edgeList.get(j)[0], edgeList.get(j)[1]);
                j++;
            }
        }

        return answer;
    }

    public int find(int num) {
        if (parent[num] != num) {
            parent[num] = find(parent[num]);
        }
        return parent[num];
    }

    private void union(int p, int q) {
        int rootP = find(p);
        int rootQ = find(q);

        if (rootP == rootQ) {
            return;
        }

        if (size[rootP] < size[rootQ]) {
            int temp = rootP;
            rootP = rootQ;
            rootQ = temp;
        }
        parent[rootQ] = rootP;
        size[rootP] += size[rootQ];
    }
}

