public class Solution {
    public int maximumRequests(int n, int[][] requests) {
        int[] count = new int[n];
        return backtrack(requests, 0, count);
    }

    private int backtrack(int[][] requests, int index, int[] count) {
        if (index == requests.length) {
            for (int i : count) {
                if (i != 0) {
                    return 0;
                }
            }
            return requests.length;
        }

        int[] newCount = count.clone();
        boolean[] visited = new boolean[requests.length];

        for (int i = 0; i < n; i++) {
            if (!visited[i]) {
                newCount[requests[index][1]] += 1;
                newCount[requests[index][0]] -= 1;
                visited[i] = true;

                int result = backtrack(requests, index + 1, newCount);

                if (result != 0) {
                    return result;
                }

                newCount[requests[index][1]] -= 1;
                newCount[requests[index][0]] += 1;
            }
        }

        return 0;
    }
}

