public class Solution {
    public int maxProfit(int[] inventory, int orders) {
        Arrays.sort(inventory);
        long sum = 0;
        for (int i = inventory.length - 1; i >= 0 && orders > 0; --i) {
            if (inventory[i] == 0) continue;
            int j = i - 1;
            while (j >= 0 && orders > 0 && inventory[j] == inventory[i]) {
                --orders;
                sum += ((long) inventory[i] + (long) inventory[j] + 1) * (inventory[i] - inventory[j]);
                ++j;
            }
            if (orders <= 0) break;
            int k = j;
            while (k >= 0 && orders > 0) {
                --orders;
                sum += ((long) inventory[i] + (long) inventory[k]) * (inventory[i] - inventory[k]);
                --k;
            }
            if (i == j) break;
            inventory[j] = inventory[i] - 1;
        }
        return (int) (sum % (1000000007));
    }
}

