        StringBuilder sb = new StringBuilder();
        for (char c : number.toCharArray()) {
            if (!Character.isDigit(c)) continue;
            sb.append(c);
        }

        int n = sb.length();
        while (n > 4) {
            if (n % 3 == 0) {
                sb.insert(0, "-");
                sb.deleteCharAt(n - 1);
                n -= 2;
            } else {
                sb.insert(0, "-");
                sb.deleteCharAt(n - 2);
                n -= 3;
            }
        }

        if (n == 4) {
            sb.insert(0, "-");
            sb.deleteCharAt(n - 1);
            n--;
        }

        while (n > 2) {
            sb.insert(0, "-");
            sb.deleteCharAt(n - 2);
            n -= 2;
        }

        return sb.toString();
    }
}

