public class Solution {
    public int[] maxSumOfThreeSubarrays(int[] nums, int k) {
        int n = nums.length;
        int[] sums = new int[n + 1];
        for (int i = 0; i < n; i++) {
            sums[i + 1] = sums[i] + nums[i];
        }

        int[][] dp = new int[3][n + 1];
        for (int i = 0; i <= n - k; i++) {
            int sum = sums[i + k] - sums[i];
            if (sum > dp[0][i]) {
                dp[0][i] = sum;
            }
            if (dp[0][i - k] != 0 && sum + dp[0][i - k] > dp[1][i]) {
                dp[1][i] = sum + dp[0][i - k];
            }
            if (dp[1][i - 2 * k] != 0 && dp[1][i - 2 * k] + sum > dp[2][i]) {
                dp[2][i] = dp[1][i - 2 * k] + sum;
            }
        }

        int maxSum = Integer.MIN_VALUE;
        int[] result = new int[3];
        for (int i = n - k; i >= 0; i--) {
            if (dp[0][i] != 0 && dp[1][i] != 0 && dp[2][i] != 0) {
                if (maxSum < dp[0][i] + dp[1][i] + dp[2][i]) {
                    maxSum = dp[0][i] + dp[1][i] + dp[2][i];
                    result[0] = i;
                    result[1] = i + k;
                    result[2] = i + 2 * k;
                }
            }
        }

        return result;
    }
}

