import java.util.*;

public class Solution {
    public int cutOffTree(List<List<Integer>> forest) {
        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> a[2] - b[2]);
        for (int i = 0; i < forest.size(); i++) {
            for (int j = 0; j < forest.get(i).size(); j++) {
                if (forest.get(i).get(j) > 1) {
                    pq.offer(new int[]{i, j, forest.get(i).get(j)});
                }
            }
        }

        int startRow = 0;
        int startCol = 0;
        int steps = 0;

        while (!pq.isEmpty()) {
            int[] tree = pq.poll();
            int endRow = tree[0];
            int endCol = tree[1];

            int[][] directions = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};
            Queue<int[]> queue = new LinkedList<>();
            boolean foundPath = bfs(forest, startRow, startCol, endRow, endCol, directions, queue);

            if (!foundPath) {
                return -1;
            }

            steps += queue.size();
            startRow = endRow;
            startCol = endCol;
        }

        return steps;
    }

    private boolean bfs(List<List<Integer>> forest, int startRow, int startCol, int endRow, int endCol, int[][] directions, Queue<int[]> queue) {
        if (startRow == endRow && startCol == endCol) {
            return true;
        }

        boolean[][] visited = new boolean[forest.size()][forest.get(0).size()];
        queue.offer(new int[]{startRow, startCol});
        visited[startRow][startCol] = true;

        while (!queue.isEmpty()) {
            int[] current = queue.poll();
            int row = current[0];
            int col = current[1];

            for (int[] direction : directions) {
                int newRow = row + direction[0];
                int newCol = col + direction[1];

                if (newRow >= 0 && newRow < forest.size() && newCol >= 0 && newCol < forest.get(0).size()
                        && !visited[newRow][newCol] && forest.get(newRow).get(newCol) != 0) {
                    queue.offer(new int[]{newRow, newCol});
                    visited[newRow][newCol] = true;

                    if (newRow == endRow && newCol == endCol) {
                        return true;
                    }
                }
            }
        }

        return false;
    }
}

