public class Solution {
    public int findKthNumber(int m, int n, int k) {
        long left = 1;
        long right = (long)m * n + 1;
        while (left < right) {
            long mid = left + (right - left) / 2;
            long count = 0;
            for (int i = 1; i <= m; i++) {
                int j = (int)(mid / i);
                if (j > n) break;
