import java.util.*;

public class Solution {
    public String replaceWords(List<String> dictionary, String sentence) {
        TrieNode root = new TrieNode();
        for (String word : dictionary) {
            insert(root, word);
        }
        StringBuilder result = new StringBuilder();
        String[] words = sentence.split(" ");
        for (String word : words) {
            String replacedWord = getShortestRoot(word, root);
            if (!replacedWord.isEmpty()) {
                result.append(replacedWord).append(" ");
            } else {
                result.append(word).append(" ");
            }
        }
        return result.toString().trim();
    }

    private void insert(TrieNode node, String word) {
        int index = 0;
        for (char c : word.toCharArray()) {
            if (!node.children[c - 'a'].isEndOfWord) {
                node.children[c - 'a'] = new TrieNode();
            }
            node = node.children[c - 'a'];
            index++;
        }
        node.isEndOfWord = true;
    }

    private String getShortestRoot(String word, TrieNode root) {
        StringBuilder shortestWord = new StringBuilder();
        int index = 0;
        for (char c : word.toCharArray()) {
            if (!root.children[c - 'a'].isEndOfWord) {
                return "";
            }
            if (shortestWord.length() == 0 || shortestWord.length() < root.children[c - 'a'].word.length()) {
                shortestWord = new StringBuilder(root.children[c - 'a'].word);
            }
            index++;
        }
        return shortestWord.toString();
    }

    private static class TrieNode {
        boolean isEndOfWord;
        String word;
        TrieNode[] children;

        public TrieNode() {
            this.isEndOfWord = false;
            this.word = "";
            this.children = new TrieNode[26];
        }
    }
}

