            for (int i = 0; i + len - 1 < n; i++) {
                int j = i + len - 1;

                if (chars[i] == chars[j]) {
                    dp[i][j] = dp[i][j-1];
                } else {
                    dp[i][j] = Math.min(dp[i][j-1], 1 + dp[i+1][j]);
                }
            }
        }

        return dp[0][n-1];
    }
}

