public class Solution {
    public int flipLights(int n, int m) {
        if (n >= 4 && m >= 3) return 8;
        if (n >= 3 && m >= 2) return 8;
        if (n >= 2 && m >= 1) return 4;

        int[] bulbs = new int[8];
        for (int i = 0; i < 8; i++) {
            String binary = Integer.toBinaryString(i);
            while (binary.length() < n) binary = "0" + binary;
            if (binary.charAt(n - 1) == '1') bulbs[i]++;
            if (n >= 2 && binary.charAt(n - 2) == '1') bulbs[i]++;
            if (n >= 3 && binary.charAt(n - 3) == '1') bulbs[i]++;
        }

        int count = 0;
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < 8; j++) {
                if ((bulbs[j] & 1) != 0 || m == 1) count++;
                if (n >= 2 && (bulbs[j] & 2) != 0 || m == 1) count++;
                if (n >= 3 && (bulbs[j] & 4) != 0 || m == 1) count++;
            }
        }

        return count;
    }
}

