                x += sign ? 1 : -1;
                sign = true;
            }
        }

        y += sign ? Integer.parseInt(num.toString()) : -Integer.parseInt(num.toString());

        int diff = x - y;

        if (diff == 0) return "Infinite solutions";
        else if (x % diff == 0 && y % diff == 0) return "No solution";
        else return "x=" + diff;
    }
}

