import java.util.*;

public class Solution {
    public int[] findRedundantDirectedConnection(int[][] edges) {
        int n = edges.length;
        List<Integer>[] graph = new ArrayList[n + 1];
        for (int i = 0; i <= n; i++) {
            graph[i] = new ArrayList<>();
        }

        boolean[] visited = new boolean[n + 1];
        boolean[] inCycle = new boolean[n + 1];
        int[] parent = new int[n + 1];
        Arrays.fill(parent, -1);

        for (int[] edge : edges) {
            graph[edge[0]].add(edge[1]);
            if (parent[edge[1]] == 0) {
                parent[edge[1]] = edge[0];
            } else {
                int[] redundantEdge = new int[]{parent[edge[1]], edge[1]};
                return redundantEdge;
            }
        }

        for (int i = 1; i <= n; i++) {
            if (!visited[i]) {
                List<Integer> cycle = dfs(graph, visited, inCycle, parent, i);
                if (cycle != null) {
                    int[] redundantEdge = new int[]{cycle.get(0), cycle.get(cycle.size() - 1)};
                    return redundantEdge;
                }
            }
        }

        for (int[] edge : edges) {
            if (parent[edge[1]] == edge[0]) {
                continue;
            }
            parent[edge[1]] = edge[0];
            boolean isCycle = false;
            for (int i = 1; i <= n; i++) {
                if (!visited[i]) {
                    List<Integer> cycle = dfs(graph, visited, inCycle, parent, i);
                    if (cycle != null) {
                        isCycle = true;
                        break;
                    }
                }
            }
            if (!isCycle) {
                return edge;
            }
            parent[edge[1]] = 0;
        }

        return new int[]{};
    }

    private List<Integer> dfs(List<Integer>[] graph, boolean[] visited, boolean[] inCycle, int[] parent, int node) {
        visited[node] = true;
        inCycle[node] = true;
        for (int neighbor : graph[node]) {
            if (!visited[neighbor]) {
                parent[neighbor] = node;
                List<Integer> cycle = dfs(graph, visited, inCycle, parent, neighbor);
                if (cycle != null) {
                    return cycle;
                }
            } else if (inCycle[neighbor]) {
                List<Integer> cycle = new ArrayList<>();
                while (node != neighbor) {
                    cycle.add(node);
                    node = parent[node];
                }
                cycle.add(neighbor);
                return cycle;
            }
        }
        inCycle[node] = false;
        return null;
    }
}

