public class Solution {
    public double knightProbability(int n, int k, int row, int column) {
        if (k < 0 || row < 0 || column < 0 || row >= n || column >= n) return 0;

        double[][][] dp = new double[n][n][k + 1];
        dp[row][column][0] = 1;

        int[] dr = {-2, -2, -1, -1, 1, 1, 2, 2};
        int[] dc = {-1, 1, -2, 2, -2, 2, -1, 1};

        for (int i = 0; i < k; i++) {
            double[][][] newDp = new double[n][n][k + 1];
            for (int r = 0; r < n; r++) {
                for (int c = 0; c < n; c++) {
                    if (dp[r][c][i] == 0) continue;
                    for (int j = 0; j < 8; j++) {
                        int nr = r + dr[j];
                        int nc = c + dc[j];
                        if (nr >= 0 && nc >= 0 && nr < n && nc < n) {
                            newDp[nr][nc][i + 1] += dp[r][c][i] / 8;
                        }
                    }
                }
            }
            dp = newDp;
        }

        double probability = 0;
        for (int i = 0; i <= k; i++) {
            for (int r = 0; r < n; r++) {
                for (int c = 0; c < n; c++) {
                    if (dp[r][c][i] > 0) probability += dp[r][c][i];
                }
            }
        }

        return probability;
    }
}

