import java.util.HashMap;
import java.util.Map;

public class Solution {
    public boolean isPossible(int[] nums) {
        Map<Integer, Integer> countMap = new HashMap<>();
        for (int num : nums) {
            countMap.put(num, countMap.getOrDefault(num, 0) + 1);
        }

        for (int num : nums) {
            int count = countMap.get(num);
            if (count > 0) {
                int nextNum = num + 1;
                int nextNextNum = num + 2;

                // Check if we can form a subsequence of length 3
                if (!canFormSubsequence(countMap, nextNum, nextNextNum)) {
                    return false;
                }

                countMap.put(num, count - 1);
            }
        }

        return true;
    }

    private boolean canFormSubsequence(Map<Integer, Integer> countMap, int num, int nextNum) {
        if (countMap.containsKey(nextNum) && countMap.get(nextNum) > 0) {
            int count = countMap.get(nextNum);
            countMap.put(nextNum, count - 1);

            if (countMap.containsKey(num + 2) && countMap.get(num + 2) > 0) {
                int nextNextCount = countMap.get(num + 2);
                countMap.put(num + 2, nextNextCount - 1);
                return true;
            } else {
                countMap.put(nextNum, count + 1); // backtrack
            }
        }

        return false;
    }
}

