import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

public class Solution {
    public int shoppingOffers(int[] price, int[][] specials, List<Integer> needs) {
        Map<String, Integer> memo = new HashMap<>();
        return dfs(price, specials, needs, 0, memo);
    }

    private int dfs(int[] price, int[][] specials, List<Integer> needs, int index, Map<String, Integer> memo) {
        String key = needs.toString();
        if (memo.containsKey(key)) {
            return memo.get(key);
        }
        int totalCost = 0;
        for (int i = 0; i < needs.size(); i++) {
            totalCost += price[i] * needs.get(i);
        }

        boolean canUseSpecial = true;
        for (int i = 0; i <= index && canUseSpecial; i++) {
            if (!canUseOffer(price, specials[i], needs)) {
                continue;
            }
            int cost = specials[i][needs.size()];
            List<Integer> newNeeds = new ArrayList<>(needs);
            for (int j = 0; j < needs.size(); j++) {
                newNeeds.set(j, newNeeds.get(j) - specials[i][j]);
            }
            cost -= dfs(price, specials, newNeeds, index + 1, memo);
            totalCost = Math.min(totalCost, cost);
        }

        memo.put(key, totalCost);
        return totalCost;
    }

    private boolean canUseOffer(int[] price, int[] special, List<Integer> needs) {
        for (int i = 0; i < needs.size(); i++) {
            if (special[i] > needs.get(i)) {
                return false;
            }
        }
        return true;
    }
}

