import java.util.Arrays;

public class Solution {
    public boolean canPartitionKSubsets(int[] nums, int k) {
        int totalSum = 0;
        for (int num : nums) {
            totalSum += num;
        }

        if (totalSum % k != 0) {
            return false;
        }

        int targetSum = totalSum / k;
        Arrays.sort(nums);
        boolean[] visited = new boolean[nums.length];
        return backtrack(nums, targetSum, 0, visited, k);
    }

    private boolean backtrack(int[] nums, int targetSum, int start, boolean[] visited, int k) {
        if (k == 1) {
            return true;
        }

        for (int i = start; i < nums.length; i++) {
            if (!visited[i]) {
                if (nums[i] > targetSum) {
                    continue;
                }

                visited[i] = true;
                if (backtrack(nums, targetSum - nums[i], i + 1, visited, k - 1)) {
                    return true;
                }

                visited[i] = false;
            }
        }

        return false;
    }
}

