public class Solution {
    public TreeNode addOneRow(TreeNode root, int val, int depth) {
        if (depth == 1) {
            TreeNode newRoot = new TreeNode(val);
            newRoot.left = root;
            return newRoot;
        }

        Queue<TreeNode> queue = new LinkedList<>();
        queue.offer(root);
        boolean isLastLevel = true;
        while (!queue.isEmpty()) {
            int size = queue.size();
            for (int i = 0; i < size; i++) {
                TreeNode cur = queue.poll();
                if (isLastLevel && depth == size + 1) {
                    TreeNode leftChild = new TreeNode(val);
                    TreeNode rightChild = new TreeNode(val);
                    leftChild.left = cur.left;
                    rightChild.right = cur.right;
                    cur.left = leftChild;
                    cur.right = rightChild;
                } else if (!isLastLevel && depth == size + 1) {
                    TreeNode leftChild = new TreeNode(val);
                    TreeNode rightChild = new TreeNode(val);
                    leftChild.left = cur.left;
                    rightChild.right = cur.right;
                    cur.left = leftChild;
                    cur.right = rightChild;
                }
                if (cur.left != null) queue.offer(cur.left);
                if (cur.right != null) queue.offer(cur.right);
            }
            isLastLevel = false;
        }

        return root;
    }
}

