public class Solution {
    public List<List<String>> printTree(TreeNode root) {
        int height = getHeight(root);
        int rows = height + 1;
        int cols = (int) Math.pow(2, height + 1) - 1;

        String[][] res = new String[rows][cols];
        for (String[] row : res) {
            java.util.Arrays.fill(row, "");
        }

        dfs(root, 0, (cols - 1) / 2, res);

        List<List<String>> result = new ArrayList<>();
        for (int i = 0; i < rows; i++) {
            List<String> row = new ArrayList<>();
            for (String s : res[i]) {
                row.add(s);
            }
            result.add(row);
        }

        return result;
    }

    private int getHeight(TreeNode node) {
        if (node == null) {
            return 0;
        } else {
            return Math.max(getHeight(node.left), getHeight(node.right)) + 1;
        }
    }

    private void dfs(TreeNode node, int row, int col, String[][] res) {
        if (node != null) {
            res[row][col] = String.valueOf(node.val);

            int height = getHeight(node);
            int leftCol = col - (int) Math.pow(2, height - row - 1);
            int rightCol = col + (int) Math.pow(2, height - row - 1);

            dfs(node.left, row + 1, leftCol, res);
            dfs(node.right, row + 1, rightCol, res);
        }
    }
}

