public class Solution {
    public int widthOfBinaryTree(TreeNode root) {
        if (root == null) return 0;

        Queue<Pair> queue = new LinkedList<>();
        queue.offer(new Pair(root, 1));
        int maxWidth = 0;
        int leftmost = 1;

        while (!queue.isEmpty()) {
            int size = queue.size();
            int rightmost = queue.peek().idx;

            for (int i = 0; i < size; i++) {
                TreeNode node = queue.poll().node;

                if (i == 0) leftmost = queue.peek().idx;
                if (i == size - 1) rightmost = queue.peek().idx;

                if (node.left != null) queue.offer(new Pair(node.left, 2 * queue.peek().idx));
                if (node.right != null) queue.offer(new Pair(node.right, 2 * queue.peek().idx + 1));
            }

            maxWidth = Math.max(maxWidth, rightmost - leftmost + 1);
        }

        return maxWidth;
    }

    public static class Pair {
        TreeNode node;
        int idx;

        public Pair(TreeNode node, int idx) {
            this.node = node;
            this.idx = idx;
        }
    }
}

