public class Solution {
    public int maxPoints(int[][] points) {
        if (points.length <= 2) return points.length;

        int n = points.length, res = 0;
        for (int i = 0; i < n; i++) {
            int samePoint = 1;
            HashMap<Double, Integer> map = new HashMap<>();
            for (int j = i + 1; j < n; j++) {
                if (points[i][0] == points[j][0] && points[i][1] == points[j][1]) {
                    samePoint++;
                    continue;
                }

                double slope = get_slope(points[i], points[j]);
                map.put(slope, map.getOrDefault(slope, 0) + 1);
            }

            res = Math.max(res, map.values().stream().max(Integer::compare).orElse(0) + samePoint);
        }

        return res;
    }

    private double get_slope(int[] p1, int[] p2) {
        if (p1[0] == p2[0]) return Double.POSITIVE_INFINITY;
        return (double)(p2[1] - p1[1]) / (p2[0] - p1[0]);
    }
}

