import java.util.Arrays;

public class Solution {
    public int minCut(String s) {
        int n = s.length();
        boolean[][] isPalindrome = new boolean[n][n];
        int[] cuts = new int[n];

        for (int i = 0; i < n; i++) {
            isPalindrome[i][i] = true;
            if (i > 0) {
                isPalindrome[i - 1][i] = s.charAt(i) == s.charAt(i - 1);
            }
            cuts[i] = i;
        }

        for (int length = 3; length <= n; length++) {
            for (int start = 0; start < n - length + 1; start++) {
                int end = start + length - 1;

                if (isPalindrome[start][end]) {
                    cuts[end] = Math.min(cuts[end], cuts[start - 1] + 1);
                } else {
                    for (int k = start; k <= end; k++) {
                        if (isPalindrome[start][k - 1] && isPalindrome[k + 1][end]) {
                            cuts[end] = Math.min(cuts[end], cuts[k] + 1);
                            break;
                        }
                    }
                }

                for (int i = start; i <= end; i++) {
                    if (s.charAt(i) == s.charAt(start)) {
                        isPalindrome[start][end] |= isPalindrome[i + 1][end];
                    }
                }
            }
        }

        return cuts[n - 1];
    }
}

