public class Solution {
    public int numDistinct(String s, String t) {
        int m = s.length();
        int n = t.length();

        // Create a 2D array dp where dp[i][j] represents the number of distinct subsequences
        // of s[0..i-1] which equals t[0..j-1]
        int[][] dp = new int[m + 1][n + 1];

        for (int i = 0; i <= m; i++) {
            for (int j = 0; j <= n; j++) {
                if (i == 0) {
                    // If s is empty, the only way to get a subsequence of t is by removing all
                    // characters from t. This can be done in 1 way.
                    dp[i][j] = 1;
                } else if (j == 0) {
                    // If t is empty, there are no subsequences of s that equal t.
                    dp[i][j] = 0;
                } else if (s.charAt(i - 1) == t.charAt(j - 1)) {
                    // If the current character in s matches the current character in t,
                    // we have two options: either include this character in our subsequence
                    // or exclude it. The number of distinct subsequences is then the sum of
                    // these two cases.
                    dp[i][j] = dp[i - 1][j - 1] + dp[i - 1][j];
                } else {
                    // If the current character in s does not match the current character in t,
                    // we cannot include this character in our subsequence. The number of
                    // distinct subsequences is then the same as if we excluded this character.
                    dp[i][j] = dp[i - 1][j];
                }
            }
        }

        return dp[m][n];
    }
}

