public class Solution {
    public TreeNode sortedListToBST(ListNode head) {
        return helper(head, null);
    }

    private TreeNode helper(ListNode slow, ListNode fast) {
        if (fast == null) {
            return null;
        }

        if (slow == null || fast.next == null) {
            return new TreeNode(slow.val);
        }

        // Find the mid of list
        fast = fast.next;
        while (fast.next != null && slow != null) {
            fast = fast.next;
            slow = slow.next;
        }

        // Right sub tree from mid - end
        TreeNode root = new TreeNode(slow.next.val);
        slow.next = slow.next.next;

        // Left sub tree from head - mid (chop slow.next)
        root.left = helper(head, slow.next);

        // Right sub tree from mid - end
        root.right = helper(slow.next, fast);

        return root;
    }
}

