        secondHalfTail.next = null;

        ListNode prev = null;
        while (firstHalf != secondHalf) {
            ListNode nextNodeFirstHalf = firstHalf.next;
            ListNode nextNodeSecondHalf = secondHalf.next;

            firstHalf.next = secondHalf;
            secondHalf.next = nextNodeFirstHalf;

            prev = secondHalf;
            firstHalf = nextNodeFirstHalf;
            secondHalf = nextNodeSecondHalf;
        }

        if (firstHalf == secondHalf) {
            prev.next = null;
        }
    }
}

