import java.util.*;

public class Solution {
    public List<List<String>> findLadders(String beginWord, String endWord, List<String> wordList) {
        Set<String> wordSet = new HashSet<>(wordList);
        if (!wordSet.contains(endWord)) return new ArrayList<>();

        Map<String, List<String>> graph = new HashMap<>();
        Queue<String> queue = new LinkedList<>();
        queue.offer(beginWord);
        wordSet.remove(beginWord);

        while (!queue.isEmpty()) {
            String current = queue.poll();

            for (int i = 0; i < current.length(); i++) {
                for (char c = 'a'; c <= 'z'; c++) {
                    String next = current.substring(0, i) + c + current.substring(i + 1);

                    if (wordSet.contains(next)) {
                        graph.computeIfAbsent(current, k -> new ArrayList<>()).add(next);
                        wordSet.remove(next);
                        queue.offer(next);
                    }
                }
            }
        }

        List<List<String>> ans = new ArrayList<>();
        dfs(graph, beginWord, endWord, new ArrayList<>(), ans);
        return ans;
    }

    private void dfs(Map<String, List<String>> graph, String current, String end, List<String> path, List<List<String>> ans) {
        if (current.equals(end)) {
            path.add(current);
            ans.add(new ArrayList<>(path));
            return;
        }

        for (String next : graph.getOrDefault(current, Collections.emptyList())) {
            path.add(next);
            dfs(graph, next, end, path, ans);
            path.remove(path.size() - 1);
        }
    }
}

