import com_github_leetcode.random.Node;

// Definition for a Node.
public class Solution {
    public Node copyRandomList(Node head) {
        if (head == null) return null;

        // First pass: create clone nodes and link them to next node
        Node current = head;
        while (current != null) {
            Node clone = new Node(current.val);
            clone.next = current.next;
            current.next = clone;
            current = current.next.next;
        }

        // Second pass: set random pointers of cloned nodes
        current = head;
        while (current != null) {
            if (current.random != null) {
                current.next.random = current.random.next;
            }
            current = current.next.next;
        }

        // Third pass: restore original list and return head of cloned list
        Node dummy = new Node(0);
        Node cloneHead = dummy;
        current = head;
        while (current != null) {
            cloneHead.next = current.next;
            cloneHead = cloneHead.next;
            current.next = current.next == null ? null : current.next.next;
            current = current.next;
        }

        return dummy.next;
    }
}

