public class Solution {
    public int minHeightShelves(int[][] books, int shelfWidth) {
        int n = books.length;
        int[] dp = new int[n + 1];
        for (int i = 0; i <= n; i++) {
            dp[i] = Integer.MAX_VALUE / 2;
        }
        dp[0] = 0;

        for (int i = 1; i <= n; i++) {
            int width = books[i - 1][0], height = books[i - 1][1];
            int j = i - 1;
            while (j >= 0 && width + books[j - 1][0] > shelfWidth) {
                j--;
            }
            if (j >= 0) {
                dp[i] = Math.min(dp[i], dp[j] + height);
                for (int k = j - 1; k >= 0; k--) {
                    width += books[k][0];
                    height = Math.max(height, books[k][1]);
                    if (width > shelfWidth) break;
                    dp[i] = Math.min(dp[i], dp[k] + height);
                }
            }
        }

        return dp[n];
    }
}

