            if (i > 0 && text.charAt(i) == text.charAt(i - 1)) {
                int left = i - 2 >= 0 ? counts[i - 2] : 0;
                maxLen = Math.max(maxLen, counts[i] + charCount.get(text.charAt(i)) - left);
            }
        }

