        if (set.contains(node.val)) {
            if (isRoot) {
                TreeNode left = dfs(node.left, false, set, res);
                TreeNode right = dfs(node.right, false, set, res);
                return null;
            } else {
                node.left = dfs(node.left, false, set, res);
                node.right = dfs(node.right, false, set, res);
                return node;
            }
        }

        if (isRoot) {
            TreeNode left = dfs(node.left, false, set, res);
            TreeNode right = dfs(node.right, false, set, res);
            if (left == null && right == null) {
                return null;
            } else if (left != null && right == null) {
                return left;
            } else if (left == null && right != null) {
                return right;
            } else {
                return node;
            }
        }

        return node;
    }
}

