public class Solution {
    public int stoneGameIII(int[] piles) {
        int n = piles.length;
        int[] dp = new int[n];
        int[] prefixSum = new int[n + 1];

        for (int i = 0; i < n; i++) {
            prefixSum[i + 1] = prefixSum[i] + piles[i];
        }

        for (int i = n - 1; i >= 0; i--) {
            for (int j = Math.max(1, i); j <= 2 * (i + 1) && j <= n; j++) {
                dp[i] = Math.max(dp[i], prefixSum[j + 1] - prefixSum[i + 1] + (j == n ? 0 : dp[j]));
            }
        }

        return dp[0];
    }
}

