public class Solution {
    public int[] smallestSufficientTeam(String[] skills, List<List<String>> people) {
        Map<String, Integer> skillMap = new HashMap<>();
        for (int i = 0; i < skills.length; i++) {
            skillMap.put(skills[i], i);
        }

        int n = people.size();
        boolean[][] dp = new boolean[n][1 << skills.length];
        int[] prev = new int[n];
        Arrays.fill(prev, -1);

        for (int i = 0; i < n; i++) {
            dp[i][0] = true;
        }

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < skills.length; j++) {
                if (!dp[i][(1 << j)]) continue;

                int mask = 1 << j;
                for (int k = 0; k < n; k++) {
                    if ((people.get(k).get(j) != null && !dp[k][mask]) || people.get(i).get(j) == null) continue;

                    dp[k][mask] = true;
                    prev[k] = i;
                }
            }
        }

        int index = -1;
        for (int i = 0; i < n; i++) {
            if (dp[i][(1 << skills.length) - 1]) {
                index = i;
                break;
            }
        }

        List<Integer> ans = new ArrayList<>();
        while (index != -1) {
            ans.add(index);
            int prevIndex = prev[index];
            index = prevIndex;
        }

        Collections.reverse(ans);
        return ans.stream().mapToInt(i -> i).toArray();
    }
}

