public class Solution {
    public boolean parseBoolExpr(String expression) {
        List<Boolean> stack = new ArrayList<>();
        char[] chars = expression.toCharArray();
        int i = 0;
        while (i < chars.length) {
            if (chars[i] == '(') {
                i++;
                while (i < chars.length && chars[i] != ')') {
                    if (chars[i] == '!') {
                        stack.add(!stack.remove(stack.size() - 1));
                    } else if (chars[i] == '&') {
                        i++;
                        List<Boolean> temp = new ArrayList<>();
                        while (i < chars.length && chars[i] != ')') {
                            temp.add(parseBoolExpr(String.valueOf(chars, i + 1, chars[i + 1] == ')' ? chars[i + 1] - i : Integer.MAX_VALUE)));
                            i += String.valueOf(chars, i + 1, chars[i + 1] == ')' ? chars[i + 1] - i : Integer.MAX_VALUE).length() + (chars[i + 1] == ')' ? 1 : 0);
                        }
                        stack.add(temp.stream().allMatch(x -> x));
                    } else if (chars[i] == '|') {
                        i++;
                        List<Boolean> temp = new ArrayList<>();
                        while (i < chars.length && chars[i] != ')') {
                            temp.add(parseBoolExpr(String.valueOf(chars, i + 1, chars[i + 1] == ')' ? chars[i + 1] - i : Integer.MAX_VALUE)));
                            i += String.valueOf(chars, i + 1, chars[i + 1] == ')' ? chars[i + 1] - i : Integer.MAX_VALUE).length() + (chars[i + 1] == ')' ? 1 : 0);
                        }
                        stack.add(temp.stream().anyMatch(x -> x));
                    } else {
                        stack.add(parseBoolExpr(String.valueOf(chars, i, chars[i] == 't' || chars[i] == 'f' ? 1 : Integer.MAX_VALUE)));
                        i += String.valueOf(chars, i, chars[i] == 't' || chars[i] == 'f' ? 1 : Integer.MAX_VALUE).length();
                    }
                }
                i++;
            } else {
                stack.add(Boolean.parseBoolean(String.valueOf(chars, i++, 1)));
            }
        }
        return stack.get(0);
    }
}

