public class Solution {
    private static final int MOD = (int) 1e9 + 7;

    public int kConcatenationMaxSum(int[] arr, int k) {
        long sum = 0;
        for (int num : arr) {
            sum += num;
        }

        if (k == 1) {
            return kadane(arr);
        } else if (k % 2 != 0) {
            long maxSum = Integer.MIN_VALUE;
            long currentSum = 0;

            for (int i = 0; i < arr.length * 2; i++) {
                currentSum += arr[i % arr.length];

                if (currentSum > maxSum) {
                    maxSum = currentSum;
                }

                if (currentSum < 0) {
                    currentSum = 0;
                }
            }

            return Math.max(maxSum, kadane(arr));
        } else {
            long sum2 = 0;
            for (int num : arr) {
                sum2 += num;
            }

            return kadane(arr) + (sum2 * (k - 2)) % MOD;
        }
    }

    private int kadane(int[] arr) {
        int maxSum = Integer.MIN_VALUE;
        int currentSum = 0;

        for (int i : arr) {
            currentSum += i;

            if (currentSum > maxSum) {
                maxSum = currentSum;
            }

            if (currentSum < 0) {
                currentSum = 0;
            }
        }

        return maxSum % MOD;
    }
}

