public class Solution {
    public List<Integer> pathInZigZagTree(int label) {
        int row = (int) Math.log(label + 1) / Math.log(2);
        int maxLabel = (1 << (row + 1)) - 1;
        List<Integer> res = new LinkedList<>();
        while (label > 0) {
            if ((row & 1) == 0) {
                res.add(maxLabel - label + 1);
            } else {
                res.add(label);
            }
            label = (label - 1) >> 1;
            row--;
            maxLabel >>= 1;
        }
        List<Integer> ans = new LinkedList<>();
        for (int i = res.size() - 1; i >= 0; i--) {
            ans.add(res.get(i));
        }
        return ans;
    }
}

