            int mask = 0;
            for (char c : puzzle.toCharArray()) {
                if (c == 'a') continue;
                mask |= 1 << (c - 'a');
            }
            int count = wordCount.getOrDefault(Integer.toBinaryString(mask), 0);
            result.add(count);
        }

        return result;
    }
