public class Solution {
    public int largest1BorderedSquare(int[][] grid) {
        int m = grid.length;
        int n = grid[0].length;
        int[] row = new int[n + 1];
        int[] col = new int[m + 1];

        int maxSide = 0;

        for (int i = 1; i <= m; i++) {
            for (int j = 1; j <= n; j++) {
                if (grid[i - 1][j] == 1) row[j]++;
                else row[j] = 0;
                if (grid[i][j - 1] == 1) col[i]++;
                else col[i] = 0;

                int minSide = Math.min(row[j], col[i]);
                for (int k = minSide; k > 0; k--) {
                    if (grid[i - k][j - k] == 1 && grid[i + k][j - k] == 1
                            && grid[i - k][j + k] == 1 && grid[i + k][j + k] == 1) {
                        maxSide = Math.max(maxSide, k);
                    }
                }
            }
        }

        return (maxSide == 0) ? 0 : (maxSide * maxSide);
    }
}

