            if (text.substring(start, i + 1).equals(text.substring(end - (i - start) + 1, end + 1))) {
                ans = Math.max(ans, dfs(text, start, i, dp) + dfs(text, i + 1, end, dp));
            }
        }
        dp[start] = ans;
        return ans;
    }
}

