import java.util.*;

class Solution {
    public int[] shortestAlternatingPaths(int n, int[][] redEdges, int[][] blueEdges) {
        List<List<Integer>> graph = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            graph.add(new ArrayList<>());
        }

        for (int[] edge : redEdges) {
            graph.get(edge[0]).add(edge[1]);
        }

        for (int[] edge : blueEdges) {
            graph.get(edge[0]).add(edge[1]);
        }

        int[][] directions = {{-1, 0}, {0, -1}};
        Queue<int[]> queue = new LinkedList<>();
        boolean[][] visited = new boolean[n][2];
        queue.offer(new int[]{0, 0, 0});

        int[] answer = new int[n];
        Arrays.fill(answer, Integer.MAX_VALUE);
        answer[0] = 0;

        while (!queue.isEmpty()) {
            int[] current = queue.poll();

            for (int[] dir : directions) {
                int nextNode = current[1] + dir[0];
                if (nextNode < 0 || nextNode >= n) continue;

                boolean isRed = current[2] == 0;
                boolean isBlue = current[2] == 1;

                if ((isRed && visited[nextNode][1]) || (isBlue && visited[nextNode][0])) {
                    continue;
                }

                answer[nextNode] = Math.min(answer[nextNode], current[0] + 1);
                queue.offer(new int[]{current[0] + 1, nextNode, isRed ? 1 : 0});
                visited[nextNode][isRed ? 1 : 0] = true;
            }
        }

        for (int i = 0; i < n; i++) {
            if (answer[i] == Integer.MAX_VALUE) answer[i] = -1;
        }

        return answer;
    }
}

