public class Solution {
    public ListNode removeZeroSumSublists(ListNode head) {
        Map<Long, ListNode> map = new HashMap<>();
        ListNode dummy = new ListNode(0);
        dummy.next = head;
        long sum = 0;
        while (head != null) {
            sum += head.val;
            if (map.containsKey(sum)) {
                ListNode node = map.get(sum);
                ListNode nextNode = node.next;
                ListNode curr = node;
                while (curr != head) {
                    curr.next = nextNode;
                    nextNode = nextNode.next;
                    curr = curr.next;
                }
                head = dummy.next;
                map.clear();
                sum = 0;
                map.put(sum, dummy);
            } else {
                map.put(sum, head);
            }
            head = head.next;
        }
        return dummy.next;
    }
}

