public class Solution {
    public String alphabetBoardPath(String target) {
        int[] pos = new int[]{0, 0};
        StringBuilder sb = new StringBuilder();
        for (char c : target.toCharArray()) {
            int row = c - 'a';
            if (pos[0] == row) {
                pos[1]++;
                while (pos[1] > 5) {
                    pos[1] -= 5;
                    sb.append("D");
                }
                continue;
            } else if (pos[0] < row) {
                int diff = row - pos[0];
                for (int i = 0; i < diff; i++) {
                    pos[1] += 5;
                    sb.append("R");
                }
                while (pos[1] > 5) {
                    pos[1] -= 5;
                    sb.append("D");
                }
            } else if (pos[0] > row) {
                int diff = pos[0] - row;
                for (int i = 0; i < diff; i++) {
                    pos[1] -= 5;
                    sb.append("L");
                }
                while (pos[1] < 0) {
                    pos[1] += 5;
                    sb.append("D");
                }
            }
            pos[0] = row;
            sb.append("!").append(c);
        }
        return sb.toString();
    }
}

