public class Solution {
    public int[] numSmallerByFrequency(String[] queries, String[] words) {
        Integer[] wordFreq = new Integer[words.length];
        for (int i = 0; i < words.length; i++) {
            char minChar = findMinChar(words[i]);
            int count = countChar(words[i], minChar);
            wordFreq[i] = count;
        }
        Arrays.sort(wordFreq, Comparator.reverseOrder());

        int[] result = new int[queries.length];
        for (int i = 0; i < queries.length; i++) {
            char minChar = findMinChar(queries[i]);
            int queryCount = countChar(queries[i], minChar);
            int index = Arrays.binarySearch(wordFreq, queryCount + 1);
            if (index < 0) {
                index = -index - 2;
            }
            result[i] = words.length - index;
        }

        return result;
    }

    private char findMinChar(String s) {
        char minChar = s.charAt(0);
        for (int i = 1; i < s.length(); i++) {
            if (s.charAt(i) < minChar) {
                minChar = s.charAt(i);
            }
        }
        return minChar;
    }

    private int countChar(String s, char c) {
        int count = 0;
        for (int i = 0; i < s.length(); i++) {
            if (s.charAt(i) == c) {
                count++;
            }
        }
        return count;
    }
}

