import java.util.*;

public class Solution {
    private int[] rank;
    private List<List<Integer>> result;

    public List<List<Integer>> criticalConnections(int n, List<List<Integer>> connections) {
        // build graph
        Map<Integer, List<Integer>> graph = new HashMap<>();
        for (int i = 0; i < n; i++) {
            graph.put(i, new ArrayList<>());
        }
        for (List<Integer> connection : connections) {
            int u = connection.get(0);
            int v = connection.get(1);
            graph.get(u).add(v);
            graph.get(v).add(u);
        }

        // record rank
        this.rank = new int[n];
        Arrays.fill(this.rank, -1);

        // store result
        this.result = new ArrayList<>();

        for (int i = 0; i < n; i++) {
            if (this.rank[i] == -1) {
                dfs(i, graph, connections);
            }
        }

        return this.result;
    }

    private int dfs(int node, Map<Integer, List<Integer>> graph, List<List<Integer>> connections) {
        // record current natural rank for current node
        int currentTime = 0;

        if (this.rank[node] != -1) {
            currentTime = this.rank[node];
        } else {
            this.rank[node] = ++currentTime;
        }

        for (int nei : graph.get(node)) {
            if (nei == this.getParent(nei, connections)) {
                continue;
            }
            int neiTime = dfs(nei, graph, connections);
            // update current node's rank with neighbor's smaller ranks
            currentTime = Math.max(currentTime, neiTime);

            // check critical connection
            if (neiTime > currentTime) {
                this.result.add(Arrays.asList(node, nei));
            }
        }

        return currentTime;
    }

    private int getParent(int node, List<List<Integer>> connections) {
        for (List<Integer> connection : connections) {
            if (connection.get(0) == node || connection.get(1) == node) {
                return connection.get(connection.get(0) == node ? 1 : 0);
            }
        }

        return -1;
    }
}

