public class Solution {
    public int minNonZeroProduct(int p) {
        long MOD = 1000000007;
        long x = (long)Math.pow(2, p);
        long y = (x - 1);

        if(p == 1){
            return 1;
        }

        long ans = 1;

        for(long i = p-2; i >= 0; i--){
            ans = (ans * ((y % MOD) * ((long)Math.pow(x, i)) % MOD)) % MOD;
