public class Solution {
    public boolean canBeIncreasing(int[] nums) {
        int count = 0;
        for (int i = 1; i < nums.length; i++) {
            if (nums[i] <= nums[i - 1]) {
                count++;
                if (count > 1) return false;

                // Try removing the current element and the previous one
                boolean canRemoveCurrent = true;
                for (int j = Math.max(0, i - 2); j < i; j++) {
                    if (nums[j] >= nums[i]) {
                        canRemoveCurrent = false;
                        break;
                    }
                }

                // Try removing the current element and the next one
                boolean canRemoveNext = true;
                for (int j = i + 1; j < Math.min(nums.length, i + 3); j++) {
                    if (nums[j] <= nums[i]) {
                        canRemoveNext = false;
                        break;
                    }
                }

                // If we can remove either the current or next element and still have a strictly increasing array,
                // then we return true
                if (canRemoveCurrent || canRemoveNext) return true;

                // If we cannot remove either the current or next element, then we try removing both of them
                boolean canRemoveBoth = true;
                for (int j = Math.max(0, i - 2); j < Math.min(nums.length, i + 3); j++) {
                    if (j != i && j != i - 1) {
                        if (nums[j] >= nums[i]) {
                            canRemoveBoth = false;
                            break;
                        }
                    }
                }

                // If we can remove both elements and still have a strictly increasing array, then we return true
                if (canRemoveBoth) return true;

                // If none of the above conditions are met, then we return false
                return false;
            }
        }
        return true;
    }
}

