public class Solution {
    public int minStoneSum(int[] piles, int k) {
        PriorityQueue<Integer> pq = new PriorityQueue<>(Collections.reverseOrder());
        for (int pile : piles) {
            pq.offer(pile);
        }

        while (k-- > 0) {
            int top = pq.poll();
            if (top % 2 == 1) {
                pq.offer(top - (top + 1) / 2);
            } else {
                pq.offer(top / 2);
            }
        }

        int sum = 0;
        while (!pq.isEmpty()) {
            sum += pq.poll();
        }
        return sum;
    }
}

