public class Solution {
    public long maxMatrixSum(int[][] matrix) {
        int n = matrix.length;
        long sum = 0;
        boolean hasNegative = false;

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (matrix[i][j] < 0) {
                    hasNegative = true;
                }
                sum += Math.abs(matrix[i][j]);
            }
        }

        long maxSum = sum;

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (matrix[i][j] < 0) {
                    int minVal = Math.min(Math.min(matrix[(i + 1) % n][j], matrix[i][(j + 1) % n]), 
                                         Math.min(matrix[(i - 1 + n) % n][j], matrix[i][(j - 1 + n) % n]));

                    if (minVal >= 0 || minVal == 0) {
                        maxSum = Math.max(maxSum, sum - 2 * Math.abs(matrix[i][j]) + 2 * minVal);
                    } else {
                        maxSum = Math.max(maxSum, sum - 2 * Math.abs(matrix[i][j]));
                    }
                }
            }
        }

        if (hasNegative) {
            return maxSum;
        } else {
            return sum;
        }
    }
}

