public class Solution {
    public int[][] rotateGrid(int[][] grid, int k) {
        int m = grid.length;
        int n = grid[0].length;
        int layers = (m + n - 1) / 2;
        int rotations = k % (layers * 4);

        for (int i = 0; i < rotations; i++) {
            int top = 0, bottom = m - 1, left = 0, right = n - 1;

            while (top < bottom) {
                rotateLayer(grid, top++, bottom--, left++, right--);
            }

            if (left < right) {
                rotateLayer(grid, left++, right--);
            }
        }

        return grid;
    }

    private void rotateLayer(int[][] grid, int top, int bottom, int left, int right) {
        for (int i = 0; i < bottom - top + 1; i++) {
            int temp = grid[top][left + i];
            grid[top][left + i] = grid[bottom - i][left];
            grid[bottom - i][left] = grid[bottom][right - i];
            grid[bottom][right - i] = grid[top + i][right];
            grid[top + i][right] = temp;
        }
    }

    private void rotateLayer(int[][] grid, int left, int right) {
        for (int i = 0; i < right - left + 1; i++) {
            int temp = grid[left][i];
            grid[left][i] = grid[right - i][left];
            grid[right - i][left] = grid[grid.length - 1 - i][right];
            grid[grid.length - 1 - i][right] = grid[i][right];
            grid[i][right] = temp;
        }
    }
}

