public class Solution {
    public int maxCompatibilitySum(int[][] students, int[][] mentors) {
        Arrays.sort(students, Comparator.comparingInt(a -> a.length));
        Arrays.sort(mentors, Comparator.comparingInt(a -> a.length));

        int n = students.length;
        int m = mentors.length;
        int[] dp = new int[n + 1];
        for (int i = 0; i <= n; i++) {
            dp[i] = -1;
        }

        return helper(0, n, m, students, mentors, dp);
    }

    private int helper(int idxS, int idxM, int m, int[][] students, int[][] mentors, int[] dp) {
        if (idxS == m || idxM == m) {
            return 0;
        }
        if (dp[idxS] != -1) {
            return dp[idxS];
        }

        int ans = 0;

        for (int i = idxS; i < m; i++) {
            int score = 0;
            for (int j = 0; j < students[i].length; j++) {
                if (students[i][j] == mentors[idxM][j]) {
                    score++;
                }
            }

            ans = Math.max(ans, score + helper(i + 1, idxM + 1, m, students, mentors, dp));
        }

        return dp[idxS] = ans;
    }
}

