public class Solution {
    public int[] findPeakGrid(int[][] mat) {
        int m = mat.length;
        int n = mat[0].length;
        int left = 0, right = n - 1;

        while (left < right) {
            int mid = left + (right - left) / 2;

            boolean foundRow = false;
            for (int i = 0; i < m; i++) {
                if (mat[i][mid] > mat[i][(mid + 1) % n]) {
