        for (int i = 0; i < m; i++) {
            if (mat[i][left] > maxVal) {
                maxVal = mat[i][left];
                maxI = i;
                maxJ = left;
            }
        }

        return new int[] {maxI, maxJ};
    }
}

package referenz;


public class Solution {
    public int[] getConcatenation(int[] nums) {
        int n = nums.length;
        int[] ans = new int[2 * n];
        System.arraycopy(nums, 0, ans, 0, n);
        System.arraycopy(nums, 0, ans, n, n);
        return ans;
    }
}
